INSERT INTO `comentario` VALUES (1,49,'Ao mesmo tempo em que a bola rolar nos campos brasileiros, inicia nas redes sociais um jogo paralelo.',21,'2014-10-19 00:00:00','19:00:00',8),(2,1,'O que acontece em campo é acompanhado pela TV e comentado em tempo real na internet. Os jogadores preferidos, a escalação e avaliação sobre as atuações, nada escapa aos elogios, críticas e pitacos.',97,'2014-05-26 00:00:00','08:27:00',3),(3,120,'Essa enxurrada de comentários é a matéria-prima de um sistema de Análise de Sentimento Social criado pela IBM.',26,'2014-08-01 00:00:00','20:51:00',3),(4,97,'Com o sistema, é possível saber em tempo real o que os internautas estão falando sobre o Neymar, por exemplo. ',13,'2014-07-18 00:00:00','12:44:00',9),(5,94,'Ou avaliar se a substituição do Felipão foi aprovada. A ferramenta faz uma varredura em tudo o que está sendo publicamente postado em português sobre um tema nas redes sociais e entrega exatamente as respostas que o cliente quer saber. ',108,'2014-08-30 00:00:00','20:55:00',1),(6,59,'As informações podem ajudar patrocinadores esportivos nas suas estratégias de marketing, orientar jogadores no relacionamento com seu público e até mesmo servirem de base para o técnico nas entrevistas.',45,'2014-07-26 00:00:00','07:45:00',9),(7,77,'Podemos fazer uma medição de tudo o que está sendo falado, de acordo com o que se deseja saber. ',95,'2014-06-28 00:00:00','21:05:00',6),(8,157,'São geradas informações detalhadas, por exemplo, se os comentários sobre determinado jogador são negativos ou positivos ou se o técnico acertou ao fazer uma mudança no time”, explica Claudio Pinhanez, gerente do Laboratório de Pesquisas com foco em Analítica de Dados Sociais da IBM Brasil. ',98,'2014-06-15 00:00:00','00:16:00',2),(9,41,'É como se cada pessoa pudesse transformar-se em treinador ou participante ativo na decisão do craque do jogo, o que antes era feito apenas por especialistas de futebol.',82,'2014-03-13 00:00:00','16:07:00',6),(10,159,'O sistema da IBM está sendo testado pelos especialistas brasileiros desde as eleições presidenciais dos Estados Unidos de 2012, mas foi usado pela primeira vez em larga escala para captar opiniões nas redes sociais em português na Copa das Confederações no ano passado. ',100,'2014-08-31 00:00:00','04:44:00',1),(11,87,'É uma ferramenta da chamada computação cognitiva que cruza as informações do Twitter para identificar quais comentários são realmente importantes e quais são apenas ruídos, fazendo conclusões e identificando os sentimentos das pessoas sobre determinado tema.',102,'2014-05-25 00:00:00','21:15:00',5),(12,71,'Um dos desafios dos profissionais da IBM foi criar um mecanismo para avaliar frases cifradas e gírias. Isso porque a estrutura dos textos das redes sociais não segue o padrão convencional. ',14,'2014-06-05 00:00:00','04:57:00',3),(13,164,'“Mídia social é fala, não escrita. É fala na forma de texto. ',116,'2014-12-03 00:00:00','06:56:00',7),(14,107,'Temos diferentes tipos de frases, expressões faciais e até sons escritos. Na verdade, temos que usar técnicas de processamento de fala”, diz Claudio.',98,'2014-04-25 00:00:00','16:02:00',5),(15,63,'Com o desenvolvimento da ferramenta, a IBM consegue inclusive separar o que são opiniões verdadeiras de deboches. ',74,'2014-09-06 00:00:00','02:25:00',4),(16,49,'Palavrão é negativo ou positivo? No futebol depende do contexto. ',23,'2014-08-03 00:00:00','10:55:00',4),(17,97,'Tudo isso é avaliado. ',81,'2014-08-02 00:00:00','00:38:00',4),(18,10,'A tecnologia ainda identifica variações do mesmo nome e abreviações. ',71,'2015-01-15 00:00:00','00:18:00',9),(19,5,'Hulk pode aparecer como Ruch.',93,'2014-07-11 00:00:00','23:06:00',2),(20,133,'No meio esportivo, o sistema pode ser empregado principalmente em ações de marketing de jogadores e de clubes, um mercado que cresce muito no Brasil. ',4,'2014-07-08 00:00:00','00:04:00',7),(21,5,'“Com as informações detalhadas do que a torcida está falando, um clube pode avaliar exatamente qual estratégia seguir para cada jogador”, observa Claudio.',4,'2014-05-18 00:00:00','01:33:00',10),(22,172,'O volume de informações não é problema. ',39,'2014-09-11 00:00:00','08:30:00',10),(23,20,'É possível fazer medição em grande escala. Na final da Copa das Confederações foram analisadas 3 milhões de postagens, sendo 125 mil em cinco minutos, quando o zagueiro David Luiz evitou o gol da Espanha. ',88,'2014-04-23 00:00:00','16:10:00',2),(24,43,'O que parece uma avalanche de informações pode ser avaliado em minutos com fidelidade de resultado. ',113,'2014-08-05 00:00:00','20:47:00',5),(25,117,'O sistema foi desenvolvido por uma equipe multidisciplinar, que contou com profissionais especializados em linguística, sistemas, aprendizado de máquina e estatística, dentre outras áreas.',31,'2014-09-26 00:00:00','07:52:00',8),(26,43,'Estratégia para negócios',79,'2014-08-01 00:00:00','01:18:00',2),(27,2,'Além do esporte, o sistema pode ser aplicado por qualquer empresa que queira saber como suas marcas ou produtos são percebidos nas redes.',86,'2014-08-09 00:00:00','08:29:00',3),(28,133,'É capaz ainda de medir o sentimento de eleitores sobre os temas discutidos em campanhas políticas.',76,'2015-03-23 00:00:00','12:06:00',9),(29,143,'A ferramenta da IBM já foi testada por uma emissora de televisão para avaliar o que as pessoas estavam comentando sobre um programa recém-lançado. ',54,'2014-06-13 00:00:00','14:23:00',7),(30,118,'Os veículos de comunicação ganharam um poderoso aliado para identificar o que o público está pensando e, assim, têm a chance de envolver a audiência no diálogo.',29,'2014-08-08 00:00:00','09:41:00',5),(31,159,'Isso pode ser feito antes, depois ou durante os programas, em tempo real. ',87,'2014-11-06 00:00:00','13:33:00',8),(32,7,'Ao fim do capítulo de um seriado é possível saber se o protagonista agradou ou não.',12,'2014-06-12 00:00:00','10:20:00',7),(33,118,'O mecanismo pode ajudar na estratégia do comércio e da indústria para o lançamento de produtos ou mudanças de marcas. ',54,'2014-04-21 00:00:00','01:43:00',5),(34,155,'Em vez de esperar o resultado de uma pesquisa por semanas, a empresa terá no mesmo dia a informação de como a novidade foi recebida pelos clientes. ',26,'2014-08-07 00:00:00','04:44:00',6),(35,16,'“O sistema permite que as empresas possam conhecer o seu público. ',10,'2014-08-20 00:00:00','09:10:00',10),(36,19,'E, a partir disso, interagir com maior eficiência ou colocar produtos de melhor qualidade para essas pessoas”.',74,'2014-02-12 00:00:00','02:30:00',3),(37,29,'O Brasil é um dos países mais atuantes no Twitter. ',42,'2014-07-25 00:00:00','16:38:00',8),(38,21,'Com a ferramenta da IBM, as empresas têm a oportunidade de um diagnóstico preciso sobre o que pensa seu público e com base nessas informações interagir e traçar estratégias específicas.',38,'2014-12-04 00:00:00','06:18:00',5),(39,21,'Rodeio é uma prática recreativa que consiste em permanecer por até oito segundos sobre um animal, usualmente um cavalo ou boi. ',83,'2014-05-28 00:00:00','18:37:00',6),(40,49,'A avaliação é feita por dois árbitros cuja nota é de 0 a 50 cada',98,'2014-07-11 00:00:00','00:12:00',7),(41,147,'A prática é bastante comum no Brasil, nos Estados Unidos, no México, no Canadá, na Austrália e em mais alguns países da América Latina. ',54,'2014-10-21 00:00:00','10:11:00',5),(42,139,'O rodeio também é alvo de críticas, sustentando que a prática desrespeita os direitos animais.',41,'2014-08-15 00:00:00','12:45:00',5),(43,4,'Nos Estados Unidos do século XVII, após a vitória dos EUA sobre o México, os colonos estadunidenses incorporaram à sua cultura alguns costumes de origem espanhola que eram praticados pelos mexicanos, como as festas e a doma de animais. ',115,'2014-10-06 00:00:00','08:39:00',4),(44,23,'Com o passar do tempo, o rodeio foi se tornando mais parecido com o que conhecemos hoje, e no final do século XIX os boiadeiros realizavam apostas e exibiam seu talento domando o gado.',117,'2014-11-03 00:00:00','07:03:00',9),(45,59,'A cidade de Colorado sediou a primeira prova de montaria no ano de 1869, e entre a década de 1890 e a de 1910 o rodeio surgiu como entretenimento da população.',63,'2014-10-24 00:00:00','15:45:00',2),(46,167,'Apesar de ter surgido nos EUA, até mesmo por lá a prática do rodeio já está perdendo a força. ',37,'2014-10-08 00:00:00','22:22:00',7),(47,65,'15 cidades americanas já proibiram o rodeio, entre elas Fort Wayne, Indiana e Pasadena, na Califórnia.',109,'2014-06-04 00:00:00','00:33:00',5),(48,64,'um árbitro avalia o competidor e o outro avalia o animal, totalizando a pontuação de 0 a 100. ',88,'2014-06-21 00:00:00','13:21:00',4),(49,102,'O rodeio divide-se em algumas modalidades, tais como touro, cutiano, bareback, bulldoging, três tambores, sela americana, laço de bezerro e laço em dupla.',85,'2014-09-10 00:00:00','00:36:00',8),(50,65,'No Brasil, a maior festa de rodeio é a Festa do Peão de Barretos, que chega a reunir em torno de 450 mil pessoas e movimenta milhões de reais em diversos setores.',117,'2014-06-15 00:00:00','08:23:00',8),(51,3,'A primeira edição foi realizada em 1956.',2,'2014-10-05 00:00:00','23:25:00',6),(52,131,'2 Na edição de 2007, segundo organizadores do evento, a cantora brasileira Ivete Sangalo chegou a pedir 600 mil reais apenas de cachê, fora despesas extras.',69,'2014-03-14 00:00:00','20:16:00',10),(53,42,'3 Mesmo com as inúmeras críticas que o evento recebe, diversos artistas patrocinam e se apresentam todos os anos não apenas em Barretos, mas também nas diversas festas que ocorrem em outras cidades do interior do Brasil, principalmente nas regiões Sudeste, Centro-Oeste e Sul do país.',91,'2014-12-01 00:00:00','13:07:00',2),(54,13,' Nesta última existem os famosos rodeios crioulos, que segundo a lei N° 11719/2002 se entende por evento que envolve animais nas atividades de montaria, provas de laço, gineteadas, pealo, chasque, cura de terneiro, provas de rédeas e outras provas típicas da tradição gaúcha nas quais são avaliadas as habilidades do homem e o desempenho do animal.',47,'2014-10-16 00:00:00','09:17:00',3),(55,74,'Nesta categoria, o maior evento da América Latina é o Rodeio Crioulo Internacional de Vacaria realizado em anos pares e por onde passam mais de 350 mil pessoas por edição, realizado na cidade de Vacaria',72,'2014-07-09 00:00:00','00:39:00',9),(56,125,'No ano de 1956, na cidade de Barretos, localizada no interior do estado de São Paulo, Brasil, um grupo de rapazes solteiros realizaram a primeira Festa do Peão de Boiadeiro que se tem notícia.',50,'2014-11-04 00:00:00','03:32:00',9),(57,84,' Desde então esta grande festa ficou conhecida internacionalmente pela sua gigantesca estrutura e alta qualidade dos peões, cavalos e touros que ali se apresentam.',68,'2014-04-03 00:00:00','14:50:00',2),(58,92,' A festa é realizada no mês de agosto, coincidindo com o aniversário da cidade de Barretos, dia 25 do mesmo mês.',36,'2014-01-19 00:00:00','00:03:00',10),(59,99,'É realizada, desde sua fundação, pelo clube Os Independentes.',100,'2014-06-11 00:00:00','07:43:00',5),(60,52,'No ano de 2005, realizou o seu Jubileu de Ouro, cinquenta anos de festa.',48,'2015-05-05 00:00:00','05:56:00',1),(61,172,' Até o ano de 1984, a Festa do Peão era realizada no Recinto Paulo de Lima Correa, no centro da cidade, palco das memoráveis Exposições de Gado, notadamente nas décadas de 50, 60 e 70.',118,'2014-10-29 00:00:00','12:13:00',1),(62,34,' Os Independentes, desde 1985, realizam a festa em enorme parque cuja área é de mais de 110 hectares, projetado pelo famoso arquiteto Oscar Niemeyer, sendo que possui uma arena de rodeio com capacidade para 35 mil pessoas sentadas ou 50 mil ocupando o todo espaço da arena e arquibancada.',100,'2014-01-17 00:00:00','00:34:00',3),(63,67,' Esta grande festa tem suas raízes no transporte de gado pelas estradas de terra desde as pastagens de Minas Gerais, Goiás, Mato Grosso do Sul e Mato Grosso, passando por Barretos em direção aos frigoríficos desta cidade.',92,'2014-07-17 00:00:00','14:23:00',2),(64,76,' Os peões das comitivas que levavam estas boiadas se reuniam no entardecer para brincar de montar cavalos bravos, daí então surgindo este costume.',102,'2014-05-03 00:00:00','22:24:00',7),(65,56,' A prática do rodeio em touros, hoje muito mais dinâmica que a de cavalos, foi trazida dos Estados Unidos.',19,'2014-11-01 00:00:00','22:50:00',8),(66,153,'Um museu é, na definição do International Council of Museums (ICOM, 2001), uma instituição permanente, sem fins lucrativos, a serviço da sociedade e do seu desenvolvimento, aberta ao público e que adquire, conserva, investiga, difunde e expõe os testemunhos materiais do homem e de seu entorno, para educação e deleite da sociedade.',11,'2015-02-17 00:00:00','21:06:00',3),(67,47,'Os museus tiveram origem no hábito humano do colecionismo, que nasceu junto com a própria humanidade.',69,'2014-06-30 00:00:00','02:38:00',2),(68,154,' Desde a Antiguidade remota o homem, por infinitas razões, coleciona objetos e lhes atribui valor, seja afetivo, cultural ou simplesmente material, o que justifica a necessidade de sua preservação ao longo do tempo.',6,'2015-02-14 00:00:00','00:20:00',1),(69,107,' Milhares de anos atrás já se faziam registros sobre instituições vagamente semelhantes ao museu moderno funcionando.',104,'2014-08-12 00:00:00','19:57:00',1),(70,138,' Entretanto, somente no século XVII se consolidou o museu mais ou menos como atualmente o conhecemos.',15,'2014-05-17 00:00:00','17:24:00',4),(71,133,' Depois de outras mudanças e aperfeiçoamentos, hoje os museus, que já abarcam um vasto espectro de campos de interesse, se dirigem para uma crescente profissionalização e qualificação de suas atividades, e se caracterizam pela multiplicidade de tarefas e capacidades que lhes atribuem os museólogos e pensadores, deixando de ser passivos acúmulos de objetos para assumirem um papel importante na interpretação da cultura e na educação do homem, no fortalecimento da cidadania e do respeito à diversidade cultural, e no incremento da qualidade de vida.',60,'2014-11-27 00:00:00','18:14:00',3),(72,8,' Porém, muitos dos conceitos fundamentais que norteiam os museus contemporâneos ainda estão em debate e precisam de clarificação.',51,'2014-08-14 00:00:00','16:11:00',8),(73,52,'Um museu é, na definição do International Council of Museums (ICOM, 2001), uma instituição permanente, sem fins lucrativos, a serviço da sociedade e do seu desenvolvimento, aberta ao público e que adquire, conserva, investiga, difunde e expõe os testemunhos materiais do homem e de seu entorno, para educação e deleite da sociedade.',70,'2014-11-05 00:00:00','20:22:00',9),(74,102,'Os museus tiveram origem no hábito humano do colecionismo, que nasceu junto com a própria humanidade.',71,'2015-03-18 00:00:00','21:24:00',6),(75,140,' Desde a Antiguidade remota o homem, por infinitas razões, coleciona objetos e lhes atribui valor, seja afetivo, cultural ou simplesmente material, o que justifica a necessidade de sua preservação ao longo do tempo.',92,'2014-09-05 00:00:00','20:56:00',1),(76,61,' Milhares de anos atrás já se faziam registros sobre instituições vagamente semelhantes ao museu moderno funcionando.',89,'2014-05-19 00:00:00','22:53:00',9),(77,15,' Entretanto, somente no século XVII se consolidou o museu mais ou menos como atualmente o conhecemos.',76,'2014-10-07 00:00:00','08:44:00',5),(78,58,' Depois de outras mudanças e aperfeiçoamentos, hoje os museus, que já abarcam um vasto espectro de campos de interesse, se dirigem para uma crescente profissionalização e qualificação de suas atividades, e se caracterizam pela multiplicidade de tarefas e capacidades que lhes atribuem os museólogos e pensadores, deixando de ser passivos acúmulos de objetos para assumirem um papel importante na interpretação da cultura e na educação do homem, no fortalecimento da cidadania e do respeito à diversidade cultural, e no incremento da qualidade de vida.',96,'2014-07-29 00:00:00','05:38:00',7),(79,176,' Porém, muitos dos conceitos fundamentais que norteiam os museus contemporâneos ainda estão em debate e precisam de clarificação.',46,'2014-08-07 00:00:00','08:12:00',2),(80,82,'Apesar da origem clássica da palavra museu - do grego mouseion - a origem dos museus como locais de preservação de objetos com finalidade cultural é muito mais antiga.',18,'2014-10-18 00:00:00','17:29:00',9),(81,178,' Desde tempos remotos o homem se dedica a colecionar objetos, pelos mais diferentes motivos.',18,'2014-02-26 00:00:00','03:54:00',2),(82,76,' No Paleolítico os homens primitivos já reuniam vários tipos de artefatos, como o provam achados em tumbas.',50,'2014-07-30 00:00:00','21:34:00',4),(83,16,' Porém, um sentido mais próximo do conceito moderno de museu é encontrado somente no segundo milênio a.',6,'2014-07-06 00:00:00','09:37:00',7),(84,63,'quando na Mesopotâmia se passou a copiar inscrições mais antigas para a educação dos jovens.',21,'2014-10-27 00:00:00','11:00:00',4),(85,90,' Mais adiante, em Ur, os reis Nabucodonosor e Nabonido se dedicaram à coleção de antiguidades, e outra coleção era mantida pelos sacerdotes anexa à escola do templo, e onde cada obra era identificada com uma cartela, semelhante ao sistema expositivo atual.',75,'2014-04-27 00:00:00','13:01:00',10),(86,66,'Na Grécia Antiga o museu era um templo das musas, divindades que presidiam a poesia, a música, a oratória, a história, a tragédia, a comédia, a dança e a astronomia.',81,'2014-05-28 00:00:00','13:50:00',10),(87,6,' Esses templos, bem como os de outras divindades, recebiam muitas oferendas em objetos preciosos ou exóticos, que podiam ser exibidos ao público mediante o pagamento de uma pequena taxa.',32,'2014-04-26 00:00:00','18:38:00',2),(88,146,' Em Atenas se tornou afamada a coleção de pinturas que era exposta nas escadarias da Acrópole no século V a.Os romanos expunham coleções públicas nos fóruns, jardins públicos, templos, teatros e termas, muitas vezes reunidas como botins de guerra.',3,'2013-12-20 00:00:00','17:56:00',2),(89,49,' No oriente, onde o culto à personalidade de reis e heróis era forte, objetos históricos foram coletados com a função de preservação da memória e dos feitos gloriosos desses personagens.',28,'2014-08-26 00:00:00','18:50:00',6),(90,41,' Dos museus da Antiguidade, o mais famoso foi o criado em Alexandria por Ptolomeu Sóter em torno do século III a.',87,'2014-12-28 00:00:00','15:06:00',8),(91,156,'que continha estátuas de filósofos, objetos astronômicos e cirúrgicos e um parque zoobotânico, embora a instituição fosse primariamente uma academia de filosofia, e mais tarde incorporasse uma enorme coleção de obras escritas, formando-se a célebre Biblioteca de Alexandria.',28,'2015-03-22 00:00:00','09:18:00',5),(92,173,'Ao longo da Idade Média a noção de museu quase desapareceu, mas o colecionismo continuou vivo.',46,'2014-10-31 00:00:00','05:16:00',3),(93,63,' Por um lado os acervos de preciosidades eram considerados patrimônio de reserva a ser convertido em divisas em caso de necessidade, para financiamento de guerras ou outras atividades estatais, outras coleções se formaram com objetos ligados ao culto cristão, acumulando-se em catedrais e mosteiros quantidades de relíquias de santos, manuscritos iluminados e aparatos litúrgicos em metais e pedras preciosas.',73,'2014-09-22 00:00:00','02:39:00',8),(94,75,'3 No Renascimento, com a recuperação dos ideais clássicos e a consolidação da humanismo, ressurgiu o colecionismo privado através de grandes banqueiros e comerciantes, integrantes da burguesia em ascensão, que financiavam uma grande produção de arte profana e ornamental e se dedicavam à procura de relíquias da Antiguidade.',39,'2014-09-18 00:00:00','15:07:00',5),(95,92,' Algumas coleções se tornaram célebres pela sua riqueza, como a dos Medici, em Florença, reis, nobres e burgueses abastados de toda a Europa competiam na propaganda de suas coleções e mantinham círculos de eruditos em arte, filosofia e história em seu redor, onde se debateram ideias influentes e se conceberam novos métodos educativos, como o academismo.',106,'2014-12-06 00:00:00','10:08:00',1),(96,30,'A primeira ilustração de um gabinete de curiosidades, publicada por Ferrante Imperato em DellHistoria Naturale, Nápoles, 1599',32,'2014-05-25 00:00:00','13:22:00',1),(97,159,'Entre os séculos XVI e XVII, com a expansão do conhecimento do mundo propiciado pelas grandes navegações, se formaram na Europa inúmeros gabinetes de curiosidades, coleções altamente heterogêneas e assistemáticas de peças das mais variadas naturezas e procedências, incluindo fósseis, esqueletos, animais empalhados, minerais, curiosidades, aberrações da natureza, miniaturas, objetos exóticos de países distantes, obras de arte, máquinas e inventos, e toda a sorte de objetos raros e maravilhosos.',78,'2014-06-25 00:00:00','12:22:00',9),(98,50,' Tais gabinetes tiveram um papel importante na evolução da história e da filosofia natural especialmente ao longo do século XVII.',27,'2014-07-28 00:00:00','22:37:00',5),(99,20,'5 Na mesma época proliferaram as galerias palacianas, dedicadas à exposição de esculturas e pinturas.',23,'2015-08-04 00:00:00','20:08:00',4),(100,163,' Mas tanto os gabinetes como as galerias ainda estavam essencialmente dentro dos círculos privados, inacessíveis à população em geral.',81,'2014-05-21 00:00:00','15:08:00',4),(101,113,'4 Movidas por interesses científicos foram fundadas inúmeras sociedades e instituições, como os jardins botânicos de Pisa (1543) e o de Pádua (1545), a Real Sociedade de Londres (1660) e a Academia de Ciências de Paris (1666), que reuniam suas próprias coleções.',79,'2014-11-04 00:00:00','13:04:00',4),(102,17,'3 No Brasil a primeira coleção de que se tem notícia foi formada pelo colonizador neerlandês conde Maurício de Nassau, cuja corte se notabilizou pelo brilho científico e cultural, instalando-a em torno de 1640 no Palácio de Friburgo, em Recife, semelhante em caráter aos gabinetes de curiosidades.',61,'2014-07-26 00:00:00','12:55:00',7),(103,69,'Montagu House, sede antiga do Museu Britânico',19,'2014-08-23 00:00:00','04:00:00',8),(104,85,'Nessa tendência, apareceu em Basileia em 1671 o primeiro museu universitário,4 e na Inglaterra, em 1683, aquele que é considerado o primeiro museu moderno com objetivo declarado de educar o público, o Museu Ashmolean, criado pela Universidade de Oxford.',71,'2014-08-06 00:00:00','19:51:00',4),(105,37,' Seu acervo era eclético e se assemelhava aos antigos gabinetes de curiosidades, procedente de várias partes do mundo, reunido pela família Tradescant e previamente exibida em sua casa de Londres.',42,'2014-06-01 00:00:00','22:45:00',1),(106,70,'7 Pouco mais adiante, o espírito enciclopédico dos iluministas fortaleceu a associação do conhecimento com a razão, a ordem e a moral, favorecendo a formação de acervos sistemáticos e a atuação de instituições culturais com objetivos educativos e públicos.',2,'2015-03-30 00:00:00','03:36:00',6),(107,131,'3 Outros importantes museus fundados no século XVIII foram o Museu Britânico, aberto em Londres em 1759, e o Museu do Louvre, em Paris, em 1793, ambos iniciativas do governo de seus países.',105,'2014-03-04 00:00:00','17:34:00',1),(108,3,' O exemplo europeu, por força do colonialismo, frutificou também em outros países do Oriente e na América.',106,'2014-09-23 00:00:00','04:28:00',6),(109,44,' Em Jacarta a Sociedade de Artes e Ciência de Batavia iniciou uma coleção em 1778, que evoluiu para se tornar o Museu Central da Cultura Indonésia.',97,'2014-10-16 00:00:00','02:43:00',2),(110,49,' Na Índia ocorreu o mesmo, sendo o primeiro museu, o Museu Indiano, fundado em 1784 a partir das coleções reunidas pela Sociedade Asiática de Bengal.',86,'2014-10-18 00:00:00','16:48:00',4),(111,100,' Ambos enfocavam as artes e ciências e se dedicavam ao fomento do conhecimento.',8,'2014-11-18 00:00:00','09:28:00',7),(112,12,' Nos Estados Unidos a Charleston Library Society da Carolina do Sul em 1773 anunciou sua intenção de formar uma coleção de produtos naturais para alavancar a agricultura e a medicina da província.',69,'2014-10-19 00:00:00','12:26:00',7),(113,80,'No século XIX o museu continuou sua transformação, expandindo seus horizontes para incluir novas categorias e temas, e progressivamente abandonando o simples colecionismo para enfatizar a exibição e catalogação rigorosamente sistemáticas, tendência iniciada na Alemanha e Suíça, onde se introduziram experimentos de exibição sistematizada abrangendo vastos períodos históricos, possibilitando ao público percorrer roteiros que ofereciam panoramas de toda a história e cultura da humanidade, ao mesmo tempo em que reservavam seções para apresentação das mais recentes conquistas da ciência e tecnologia.',68,'2014-06-29 00:00:00','23:43:00',1),(114,55,' As grandes feiras e exposições universais que se realizaram a partir da década de 1850, como as de Londres, Paris e Filadélfia, faziam parte deste fascínio com o progresso e com o conhecimento enciclopédico, e serviram além disso para modernizar as práticas de exposição dos próprios museus formais.',50,'2014-06-24 00:00:00','19:57:00',8),(115,144,' O museu também desempenhou um papel na onda nacionalista romântica, contribuindo para a conscientização popular e a construção de identidades nacionais, acervando objetos ligados ao patrimônio cultural das nações, podendo-se citar como exemplo o Museu Nacional de Budapeste (1802), construído com dinheiro de impostos voluntários e mais tarde identificado com a luta para a independência local.',34,'2014-08-09 00:00:00','17:20:00',9),(116,78,' Pelos mesmos motivos aparece uma profusão de museus regionais e locais, voltados para os interesses de pequenas áreas geográficas.',51,'2014-08-25 00:00:00','20:30:00',5),(117,75,' Com a perene expansão das coleções logo tornou necessária a fundação de museus especializados em determinadas áreas do conhecimento, como o Museu da Ciência de Londres e o Museu Tecnológico em Viena.',103,'2014-08-29 00:00:00','07:01:00',4),(118,32,' Multiplicam-se neste século também os museus ao ar livre, depois do exemplo pioneiro do Museu Nórdico em Estocolmo, que preservou edificações típicas e históricas, e incluindo neste grupo os museus in situ em sítios arqueológicos.',92,'2015-01-24 00:00:00','09:38:00',9),(119,55,'Vista de uma sala do Museu da Tecnologia de Speyer, onde estão expostos entre outros artefatos o ônibus espacial russo Buran',24,'2014-11-25 00:00:00','13:49:00',1),(120,85,'As práticas colecionistas antigas eram caracterizadas acima de tudo por uma postura passiva diante da sociedade, seguindo critérios aquisitivos e administrativos vagos e em muito arbitrários, que vigoraram até meados do século XX.',103,'2014-11-16 00:00:00','07:55:00',2),(121,33,'9 Nesta altura os museus entraram em uma séria crise conceitual e, como disseram Chagas & Chagas, passou-se a criticar o caráter aristocrático, autoritário, acrítico, conservador e inibidor dessas instituições, consideradas como espécie em extinção e, por isso mesmo, apelidadas de dinossauros e de elefantes brancos .',58,'2014-12-21 00:00:00','22:00:00',4),(122,25,'10 A partir de então se procurou um aprofundamento científico da definição e das potencialidades de atuação ativa, interdisciplinar e educativa dos museus.',115,'2014-06-03 00:00:00','07:51:00',5),(123,44,' Depois de algum retrocesso, a reformulação conceitual ganhou novo impulso a partir dos anos 70-80, sendo lícito considerar esta reorientação como uma verdadeira revolução na concepção do museu público e como a fundação da museologia moderna.',95,'2014-11-14 00:00:00','17:12:00',8),(124,44,'9 Cristina Bruno sintetizou a transformação dizendo:',63,'2014-08-06 00:00:00','07:30:00',7),(125,127,'De instituições elitistas, colonizadoras, sectárias e excludentes, os museus têm procurado os caminhos da diversidade cultural, da repatriação das referências culturais, da gestão partilhada e do respeito à diferença de forma objetiva e construtiva.',5,'2014-04-28 00:00:00','06:01:00',6),(126,73,' De instituições paternalistas e autoritárias, os museus têm percorrido os árduos caminhos do diálogo cultural e da convivência com o outro.',63,'2014-10-07 00:00:00','04:53:00',9),(127,6,' De instituições isoladas e esquecidas, os museus têm valorizado a atuação em redes e sistemas, procurando mostrar a sua importância para o desenvolvimento socioeconômico.',39,'2014-04-26 00:00:00','09:30:00',1),(128,134,' De instituições devotadas exclusivamente à preservação e comunicação de objetos e coleções, os museus têm assumido a responsabilidade por ideias e problemas sociais.',113,'2014-09-26 00:00:00','06:08:00',8),(129,4,'A definição do que é um museu, de fato, e em especial o que deve ser um museu do século XXI, é complexa e permanece envolta em grande controvérsia.',55,'2014-07-17 00:00:00','15:36:00',3),(130,168,' Como ponto de partida, cite-se a dada pelo International Council of Museums (ICOM), respeitadíssimo órgão internacional, na sua 20.',60,'2014-09-06 00:00:00','19:46:00',4),(131,73,'ª Assembleia Geral, em 6 de julho de 2001: o museu é uma instituição permanente, sem fins lucrativos, a serviço da sociedade e do seu desenvolvimento, aberta ao público e que adquire, conserva, investiga, difunde e expõe os testemunhos materiais do homem e de seu entorno, para educação e deleite da sociedade.',59,'2014-07-15 00:00:00','03:22:00',1),(132,55,' Podemos encontrar também definições poéticas, como a oferecida pelo Instituto Brasileiro de Museus, instância museológica máxima no Brasil: Os museus são casas que guardam e apresentam sonhos, sentimentos, pensamentos e intuições que ganham corpo através de imagens, cores, sons e formas.',56,'2015-01-26 00:00:00','11:17:00',9),(133,37,' Os museus são pontes, portas e janelas que ligam e desligam mundos, tempos, culturas e pessoas diferentes.',114,'2014-04-30 00:00:00','13:44:00',2),(134,89,' Os museus são conceitos e práticas em metamorfose.',68,'2015-01-24 00:00:00','17:26:00',8),(135,124,'11 De acordo com a Política Nacional de Museus, os museus, mais do que instituições estáticas, são processos a serviço da sociedade, e são instâncias fundamentais para o aprimoramento da democracia, da inclusão social, da construção da identidade e do conhecimento, e da percepção crítica da realidade.',116,'2014-10-01 00:00:00','18:38:00',4),(136,82,'12 Já o IPHAN, instância superior do patrimônio histórico e artístico brasileiro, dá a seguinte definição:11',34,'2014-09-24 00:00:00','19:42:00',4),(137,24,'O museu é uma instituição com personalidade jurídica própria ou vinculada a outra instituição com personalidade jurídica, aberta ao público, a serviço da sociedade e de seu desenvolvimento e que apresenta as seguintes características:',77,'2014-06-03 00:00:00','13:37:00',10),(138,44,'I - o trabalho permanente com o patrimônio cultural, em suas diversas manifestações,',54,'2014-10-25 00:00:00','11:42:00',1),(139,81,'II - a presença de acervos e exposições colocados a serviço da sociedade com o objetivo de propiciar a ampliação do campo de possibilidades de construção identitária, a percepção crítica da realidade, a produção de conhecimentos e oportunidades de lazer,',37,'2014-10-09 00:00:00','22:24:00',10),(140,163,'III - a utilização do patrimônio cultural como recurso educacional, turístico e de inclusão social,',16,'2015-03-05 00:00:00','04:37:00',10),(141,177,'IV - a vocação para a comunicação, a exposição, a documentação, a investigação, a interpretação e a preservação de bens culturais em suas diversas manifestações,',97,'2014-06-07 00:00:00','15:20:00',10),(142,71,'V - a democratização do acesso, uso e produção de bens culturais para a promoção da dignidade da pessoa humana,',19,'2014-07-19 00:00:00','05:43:00',8),(143,166,'VI - a constituição de espaços democráticos e diversificados de relação e mediação cultural, sejam eles físicos ou virtuais.',83,'2014-12-09 00:00:00','15:26:00',5),(144,11,'Sendo assim, são considerados museus, independentemente de sua denominação, as instituições ou processos museológicos que apresentem as características acima indicadas e cumpram as funções museológicas.',38,'2014-09-06 00:00:00','09:54:00',4),(145,77,'Exposição no Museu da Língua Portuguesa',19,'2014-10-14 00:00:00','23:19:00',1),(146,8,'Pela voz de pensadores independentes o museu assume hoje dimensões extremamente variadas e abrangentes.',58,'2014-10-12 00:00:00','05:34:00',10),(147,32,' Walter Benjamin acreditava que os museus são espaços que suscitam sonhos, André Malraux, pensava que os museus são locais que proporcionam a mais elevada ideia do homem,13 Duncan Cameron disse que os museus ocupam os dois extremos de um espectro que vai de templo a fórum, e vários outros teóricos vêm expandindo e enfatizando as múltiplas capacidades e possibilidades dos museus para um enriquecimento geral no conhecimento, na qualidade de vida, na formação da consciência política e social da população, entre uma infinidade de outros benefícios.',61,'2014-09-24 00:00:00','11:15:00',6),(148,163,' Já existe inclusive uma corrente que afirma que o mundo é todo ele um vasto museu, explodindo as definições que confinam o museu a uma instituição localizada no tempo-espaço e passando a ver toda a vida e civilização humanas como passíveis de musealização.',55,'2014-01-25 00:00:00','09:35:00',2),(149,68,'14 15 16 Outros chegam a duvidar que o museu tenha um lugar em nosso futuro, entretanto, surgem dezenas de novos museus todos os meses ao redor do mundo, predominando os de arte contemporânea, antropologia e ciências.',39,'2014-07-22 00:00:00','23:57:00',4),(150,105,'17 Com o advento da internet e dos processos computadorizados, o museu pôde inclusive se catapultar para o ciberespaço e a realidade virtual.',81,'2015-01-15 00:00:00','01:55:00',9),(151,161,' Não bastasse, já se discute até o conceito de um Museu do Futuro.',36,'2014-06-07 00:00:00','08:26:00',7),(152,133,'Se a constante produção de conhecimento especializado pelas academias exige dos museus contemporâneos uma perpétua renovação e aperfeiçoamento, essa pressão pela qualificação e profissionalização com um rigor científico, cobiçando avidamente uma visitação cada vez maior, mais o desejo de musealizar tudo, já são sentidos como tendências que podem inviabilizar economicamente os museus dentro em breve, e até desvirtuar suas funções essenciais, tornando-os poços-sem-fundo para os recursos públicos, ou podendo fazê-los cair na tentação da espetacularização e banalização de seus eventos a fim de atrair maior plateia e obterem mais rendas, sem que isso, conforme apontam as pesquisas, reverta em real proveito cultural para este público, nem contribua para formar visitantes mais assíduos.',9,'2014-12-18 00:00:00','13:00:00',4),(153,143,'17 20 Nas palavras de Lara Filho,',106,'2014-10-10 00:00:00','17:42:00',2),(154,85,'As novas questões colocadas aos museus não se esgotam nas apontadas acima.',4,'2014-07-26 00:00:00','04:35:00',9),(155,42,' Em palestra do Fórum Permanente, Stijn Huijts, diretor do Museu Het Domein da cidade holandesa de Sittard, apontou desafios contemporâneos para os museus e, dentre eles, os relativos às difíceis relações com os patrocinadores – sejam eles empresas privadas ou estatais -, os relacionados ao respeito à diversidade cultural e às particularidades locais.',71,'2014-08-07 00:00:00','06:40:00',1),(156,33,' Para ele, museus são instituições científicas com uma tarefa pública e não vice-versa (ou seja, o museu não é uma instituição pública com tarefa científica) Já para Jorge Wagensberg, do Museu de Ciências de Barcelona, para despertar a curiosidade científica um museu tem que emocionar.',63,'2014-07-07 00:00:00','05:33:00',5),(157,163,' Seduzir o visitante para os mistérios da realidade é a melhor forma de fazer com que ele queira entender a realidade.',18,'2014-09-02 00:00:00','18:12:00',2),(158,13,' Um museu do século XXI, seja criado agora ou não, será aquele que se comprometer com aspectos da cultura contemporânea.',72,'2014-07-28 00:00:00','01:56:00',7),(159,168,' Não se trata apenas de assimilar as novas técnicas e tecnologias mas de estruturar políticas culturais inovadoras e estimulantes.',45,'2014-04-14 00:00:00','21:00:00',1),(160,82,'A finalidade última do museu é trazer algum tipo de benefício às pessoas e provocar mudanças em suas vidas, e não ser simplesmente uma casa de custódia para obras de arte ou um centro erudito.',6,'2014-09-09 00:00:00','18:08:00',2),(161,114,' Isto implica num constante questionamento de suas funções e propósitos.',89,'2014-10-31 00:00:00','20:08:00',4),(162,123,'Dada a complexidade das atividades museológicas, um museu geralmente se divide em vários setores, atendidos, conforme exige a regulamentação recente, por profissionais plenamente qualificados para as suas funções.',118,'2014-05-27 00:00:00','08:30:00',5),(163,2,' O diretor do museu é antes de tudo um administrador competente, não é fundamental que ele seja um erudito na área coberta pelo museu, pois em geral ele tem uma equipe de profissionais especializados em diversas tarefas particulares a fim de o assessorar.',112,'2015-01-15 00:00:00','00:33:00',8),(164,85,' O diretor responde por todo o trabalho da instituição e é o seu principal relações-públicas, e por isso também o maior captador de recursos através de seu relacionamento com os patrocinadores e o maior estabelecedor de intercâmbios culturais entre diferentes instituições.',52,'2014-06-01 00:00:00','09:39:00',10),(165,98,' O diretor é também o responsável final pela elaboração do Plano Diretor do museu, onde se define e detalha a Missão da instituição, e fiscaliza sua implementação.',47,'2014-09-20 00:00:00','07:09:00',3),(166,168,' Se o museu possuir um Conselho Consultivo ou outra instância consultiva/deliberativa, o diretor as preside.',98,'2014-09-20 00:00:00','14:44:00',3),(167,62,' O diretor possivelmente terá um corpo de funcionários administrativos próximo a si para distribuir tarefas de gestão de recursos humanos e financeiros e de assessoria jurídica, bem como permanece em contato constante com seus subordinados diretos de cada setor, a fim de orientar os trabalhos diários.',45,'2014-10-23 00:00:00','03:49:00',3),(168,145,' O diretor deve por fim zelar pela perfeita integração e harmonia entre todos os setores e funcionários.',75,'2014-11-26 00:00:00','01:50:00',2),(169,34,'Ao se lançar a diretriz principal a equipe pondera sobre vários aspectos, entre eles: Que tipo de museu se vai constituir? É um museu temático? É um museu histórico, artístico, etnológico, etc? Que tipo de peça vai ser aceita? Há condições de conservar e exibir adequadamente a coleção? Há pessoal suficiente e preparado para geri-la? Qual o propósito da coleção? Como se pretende expandi-la? Que público se deseja atingir, e como se poderá fazer isso? Como o museu vai se apresentar e inserir na vida de sua comunidade? Quais laços se estabelecerão com outras instituições similares, pesquisadores, mantenedores, patrocinadores e parceiros, e como eles serão administrados? Como serão captados e geridos os recursos financeiros? Como se definirá a estrutura administrativa e técnica?.',40,'2014-08-15 00:00:00','20:45:00',2),(170,10,'e assim por diante.',24,'2015-05-12 00:00:00','15:34:00',10),(171,17,' Nenhuma dessas perguntas pode ser respondida rápida e superficialmente, e exige longa e madura meditação e minucioso planejamento, envolvendo um grande número de profissionais especializados.',50,'2014-08-04 00:00:00','14:20:00',4),(172,125,' Além disso, é importante tentar projetar a atuação do museu no futuro, criando-se um plano que possa pelo menos em tese permanecer válido por um longo período, a fim de se evitar mudanças frequentes de rumo que prejudicariam seu bom funcionamento e tornariam a filosofia da instituição confusa e irresponsável aos olhos do público e dos especialistas, perdendo prestígio e credibilidade.',113,'2014-05-26 00:00:00','02:44:00',5),(173,127,' Isso não quer dizer que ao longo da história do museu não haja adaptações e atualizações, mas uma linha curatorial e administrativa bem embasada e consolidada e razoavelmente estável é um elemento-chave na sua afirmação como instituição de respeito.',99,'2014-10-01 00:00:00','18:18:00',5),(174,120,'A direção frequentemente se depara com desafios éticos no desempenho de suas funções, especialmente os relacionados ao uso de verbas, aquisição de novos itens, publicidade pessoal, gerenciamento de recursos humanos, intercâmbios culturais e harmonização das necessidades do museu com a legislação vigente em cada país.',98,'2015-01-25 00:00:00','12:49:00',9),(175,57,' Cada administrador precisa se adequar às demandas e usos locais, levando em consideração também as práticas internacionais.',81,'2014-08-29 00:00:00','07:09:00',5),(176,116,' Estes casos são previstos no Plano Diretor em detalhe, acompanhando as orientações dadas pelo ICOM em seu Código de Ética para Museus.',30,'2014-06-25 00:00:00','23:02:00',10),(177,167,'Peças do acervo do Museu do Brinquedo de Zurique',82,'2014-12-17 00:00:00','18:00:00',10),(178,39,'A criação e manutenção de um acervo museológico é uma tarefa trabalhosa, dispendiosa, complexa e ainda em processo de estudo e aperfeiçoamento.',57,'2014-09-12 00:00:00','00:39:00',3),(179,167,' Muitas questões fundamentais ainda estão sendo discutidas pelos especialistas, e em muitas delas ainda não se formaram consensos ou regulamentações definitivas.',15,'2014-10-17 00:00:00','18:49:00',6),(180,60,' Todo esse campo está em rápida expansão e contínua transformação.',11,'2014-05-01 00:00:00','23:30:00',7),(181,96,'29 O acervo representa o núcleo vital de todo museu, e em torno do qual giram todas as suas outras atividades.',104,'2014-07-12 00:00:00','00:20:00',3),(182,153,' O acervo idealmente é gerido por um curador, ou por uma equipe de curadores, que tem a função de manter organizada e em bom estado a coleção em seus depósitos, define conceitualmente e organiza as exposições ao público, e supervisiona as atividades de documentação e pesquisa teórica sobre a coleção a fim de produzir novo conhecimento.',118,'2014-10-27 00:00:00','23:10:00',2),(183,25,' O curador também tem um papel decisivo nos processos de aquisição e descarte de peças.',99,'2014-03-17 00:00:00','17:49:00',8),(184,30,' O curador é o responsável pela gestão do acervo segundo o que foi definido no Plano Diretor do museu, que conta com uma seção especialmente dedicada à Política de Acervo, como está previsto no Código de Ética para Museus.',95,'2014-07-10 00:00:00','17:59:00',2),(185,75,'Cada museu adota sua própria política de aquisições, mas, como foi dito, a cada dia crescem as exigências de especialização e profissionalismo.',26,'2014-07-25 00:00:00','03:44:00',4),(186,42,' Neste sentido, no processo de aquisição de peças a tendência é a de se abandonar todo diletantismo e inconsequência e convocar a intervenção de conhecedores.',20,'2014-06-29 00:00:00','14:33:00',1),(187,143,' Cada peça proposta para incorporação ao acervo é então avaliada por um curador competente, que faz suas escolhas em sintonia com a direção do museu, e de acordo com a política em vigor na instituição e com as normas e parâmetros internacionais que regem sua atuação.',1,'2014-11-09 00:00:00','07:21:00',9),(188,102,' Assim, é essencial que desde o início se delineiem e consagrem formalmente os critérios de aquisição que o museu vai seguir, pois desta decisão emergirá o rosto da coleção e sua utilidade pública.',80,'2014-06-13 00:00:00','10:46:00',8),(189,173,'Na maior parte dos grandes museus contemporâneos a avaliação prévia não é feita por apenas um indivíduo, o curador, mas por uma equipe curatorial, composta de vários membros qualificados, incluindo pelo menos um curador propriamente dito, um conservador/restaurador e um educador, além do diretor da casa, o que minimiza em muito a possibilidade de erros de avaliação.',33,'2014-05-16 00:00:00','19:34:00',5),(190,147,' O avaliador leva em conta em suma a autenticidade e qualidade da peça, a importância de seu autor (se houver autoria), seu estado de conservação, seu custo de aquisição e manutenção, sua origem e situação legal, sua pertinência para o perfil do acervo que se deseja reunir e sua potencial utilidade para projetos educativos e pesquisas futuras.',116,'2014-12-03 00:00:00','18:57:00',2),(191,67,'Aprovada a peça, antes de ser recebida no acervo ela é higienizada e desinfectada, e conforme o parecer do conservador, pode ser necessário um período de quarentena, a fim de se detectar e eliminar contaminantes ou pragas que possam se transmitir para o resto da coleção.',29,'2014-07-26 00:00:00','04:51:00',8),(192,132,'24 A seguir ela é documentada, ou seja, catalogada no sistema de registro empregado pela instituição, e só depois ela ingressa nos depósitos do museu.',48,'2014-07-29 00:00:00','07:32:00',6),(193,11,' Nas palavras de Yassuda,',55,'2014-11-18 00:00:00','17:00:00',3),(194,161,'A documentação museológica representa um aspecto da gestão dos museus destinada ao tratamento da informação em todos os âmbitos, desde a entrada do objeto no museu até a exposição, envolvendo tarefas de coleta, armazenamento, tratamento, organização, disseminação e recuperação da informação.',88,'2014-08-07 00:00:00','13:09:00',4),(195,139,' Considerando os documentos como registros da atividade humana, a documentação serve como instrumento de comunicação e preservação da informação no âmbito da memória social e da pesquisa científica.',80,'2014-09-13 00:00:00','21:50:00',8),(196,78,'Um modelo de Livro-Tombo',56,'2014-08-17 00:00:00','01:48:00',7),(197,115,'Na catalogação do acervo as informações são compiladas de uma variedade de documentos relacionados a cada peça do acervo, como fotografias, laudos de conservação, fichas descritivas, atestados de participação da peça em exposições, contratos de aquisição, etc',106,'2014-11-15 00:00:00','04:23:00',4),(198,12,'Detalhe de um catálogo digitalizado',118,'2014-10-31 00:00:00','03:39:00',4),(199,128,'O catálogo inclui pelo menos um documento básico: o livro-tombo (LT), mas ele raramente é suficiente na dinâmica de um museu contemporâneo, e precisa ser complementado por um sistema auxiliar, geralmente um arquivo informatizado e/ou fichas impressas.',94,'2014-05-07 00:00:00','03:42:00',6),(200,75,' O LT é um elenco de todas as peças da coleção, inscritas em tinta indelével em um livro especial de registro arquivístico.',101,'2014-05-23 00:00:00','14:07:00',10),(201,94,' É um documento formal e oficial de valor histórico, referencial e jurídico.',42,'2014-06-30 00:00:00','16:18:00',5),(202,145,' A inscrição no LT equivale à certidão de nascimento da peça na coleção, é um documento permanente, não deve ter erros nem ser modificado.',58,'2014-11-08 00:00:00','03:30:00',2),(203,155,' Os registros do LT são sucintos, incluindo geralmente apenas a numeração das peças por ordem de entrada na coleção (número de tombo), o nome do autor (se houver), título da peça, data, dimensões, forma de entrada e uma breve descrição da peça, além de uma rubrica do responsável pelo registro.',46,'2014-12-28 00:00:00','03:07:00',8),(204,58,'O registro informatizado, por ser um meio de manejo fácil e possibilitando pronta modificação e recuperação de dados, é talvez a mais prática forma de documentação para uso diário, e deve, ao contrário do LT, incluir uma descrição detalhada e completa de cada peça.',43,'2014-07-11 00:00:00','22:11:00',1),(205,133,' De qualquer forma, o registro informatizado deve ser copiado periodicamente e a cópia mantida em local seguro e diferente do local onde está o original, devidamente identificada e datada.',31,'2014-08-02 00:00:00','06:34:00',9),(206,163,' Se o original for perdido a recuperação das informações será possível.',96,'2014-05-18 00:00:00','17:09:00',10),(207,105,' Ainda não existe uma padronização das formas de documentação, e cada instituição estabelece a sua.',62,'2014-11-07 00:00:00','08:27:00',5),(208,155,' O importante é que ela, qualquer que seja, armazene e disponibilize com facilidade de consulta uma informação minuciosa sobre cada peça.',45,'2014-08-07 00:00:00','21:51:00',9),(209,91,' Isso inclui uma série de dados: número de tombo, título, data, dimensões, número de edição (para séries e múltiplos), local de produção, transcrição de inscrições, números e marcas, nome do autor, data e local de nascimento e morte, endereço da última residência conhecida, fone/email de contato, forma de entrada (doação, compra, coleta em campo, etc), posse ou não de direitos autorais, com detalhamento de restrições de reprodução, etc, descrição física detalhada da peça, instruções especiais para montagem, conservação e exposição, localização permanente e localização temporária, histórico detalhado (procedência, exposições de que participou, empréstimos, antigos proprietários, prêmios, etc, e, conforme o caso, descrição do sítio e dos procedimentos empregados em sua coleta de campo), histórico físico da peça (danos, decaimento, relatórios de restauros, etc), análise estético/formal, transcrição integral de documentação original associada (incluindo certificados de propriedade, recibos e contratos de compra e venda, textos críticos que recebeu e registro de aparecimento em catálogos, reportagens e publicações - e se possível obtendo para o museu a própria posse de tais documentos), fotografias em vários ângulos, com atenção a detalhes como marcas, danos, inscrições, etc, e quaisquer outros dados de interesse para a identificação, estudo, divulgação e conservação da coleção.',92,'2014-06-14 00:00:00','04:52:00',1),(210,124,' Nem sempre todas essas informações serão conhecidas ou disponíveis, mas deve ser feito um esforço para deixá-las o mais completas possível.',41,'2015-01-02 00:00:00','13:12:00',7),(211,15,'Todas essas informações podem ser impressas em fichas individuais para cada peça, que serão arquivadas para garantia do registro caso haja falha nos computadores com perda ou corrupção dos arquivos digitais.',16,'2014-11-30 00:00:00','05:00:00',8),(212,1,' As fichas podem, por outro lado, considerando a atualização constante de certas categorias de dados, ser impressas apenas como um formulário básico, a ser preenchido à mão e eventualmente corrigido se necessário, mas todas as informações do registro informatizado devem ser transportadas para as fichas, não pode haver discrepância entre as duas versões documentais.',2,'2014-07-03 00:00:00','15:59:00',7),(213,101,' É possível também fazer o caminho inverso: tomar as fichas como registro primário e só depois levar os dados para o computador.',82,'2015-01-05 00:00:00','21:24:00',2),(214,60,' Cada instituição deve decidir o método de registro como lhe parecer mais prático, completo e seguro.',2,'2014-11-07 00:00:00','04:56:00',7),(215,153,' É sobremaneira importante reunir todos os dados possíveis no momento da coleta ou aquisição, pois mais tarde pode ser impossível obtê-los.',87,'2014-09-19 00:00:00','11:26:00',6),(216,1,'A Reserva Técnica (RT), ou Depósito, é a área onde a coleção permanece quando não está sendo exibida ao público.',105,'2014-09-24 00:00:00','02:07:00',1),(217,124,' Mais uma vez, as condições deste local variam conforme o tipo de objeto preservado no museu, sendo que cada tipo de material tem exigências específicas de conservação.',75,'2014-12-02 00:00:00','08:01:00',7),(218,154,' Segundo Mirabile, os critérios que devem nortear a construção da Reserva são funcionalidade, facilidade de consulta, condições de preservação e segurança.',89,'2014-10-14 00:00:00','18:14:00',10),(219,56,'33 A conservação museológica tem bases estritamente científicas e não é produto do acaso ou do capricho.',75,'2014-07-04 00:00:00','23:18:00',7),(220,177,' Os conservadores não objetivam manter um objeto em boas condições por dois ou três anos apenas, nem por apenas dez ou vinte anos, mas, em tese, pela eternidade afora.',3,'2014-06-29 00:00:00','13:04:00',2),(221,3,' Isso, obviamente, é impossível, mas eles desenvolveram técnicas que podem estender muito o tempo de vida normal das peças, pensando que um acervo não deve servir somente à geração que o constituiu, mas a várias gerações à frente.',87,'2014-08-12 00:00:00','06:00:00',10),(222,146,' Para efeitos práticos, deve-se prever pelo menos um período futuro de cem anos quando pensamos em conservação, mas os conhecimentos atuais permitem uma extensão ainda maior, e de fato todos os meios devem ser empregados para que as coleções durem muitos séculos, já que elas são tão valiosas para a sociedade.',76,'2014-12-17 00:00:00','00:58:00',5),(223,66,' Nem sempre todas essas informações serão conhecidas ou disponíveis, mas deve ser feito um esforço para deixá-las o mais completas possível.',96,'2014-04-04 00:00:00','19:50:00',5),(224,143,'Restauradores do Museu Nacional de Varsóvia',95,'2015-07-05 00:00:00','16:00:00',1),(225,151,'É preciso lembrar que o tratamento que as obras de arte ou outros objetos que possuímos em nossas residências recebem é radicalmente diverso daquele que recebem em um museu moderno, onde é obrigatório se pensar sempre a longo prazo.',12,'2014-05-06 00:00:00','23:41:00',2),(226,72,' Em um museu, por questões de segurança e conservação, quanto menos pessoas tiverem acesso direto às obras, melhor, quanto menos elas forem manipuladas e expostas, melhor, e em todos os casos, somente pessoal especialmente treinado as toca e manipula, seguindo procedimentos padronizados internacionalmente.',54,'2014-10-23 00:00:00','00:49:00',7),(227,102,'As condições ambientais da RT devem ser constantes, com monitoramento diário, e não se pode enfatizar demais a importância de um ambiente climatizado estável na conservação de peças musealizadas.',8,'2015-01-13 00:00:00','17:42:00',7),(228,67,' A experiência mostra que mudanças de temperatura e umidade relativa do ar são altamente desestabilizadoras para a estrutura física e química das peças, especialmente em países cujo clima é sujeito a grandes variações.',11,'2014-10-08 00:00:00','12:04:00',6),(229,25,' Desta forma, as mudanças ambientais devem ser evitadas a todo custo, e especialmente as súbitas, que sobre materiais especialmente frágeis podem produzir um efeito devastador em questão de minutos.',43,'2014-09-11 00:00:00','02:55:00',5),(230,147,' A cada 10°C a maioria das reações químicas nos materiais duplica sua velocidade, e consequentemente a degradação que produzem, mas cada tipo de material tem um desempenho específico.',4,'2014-07-03 00:00:00','16:28:00',3),(231,1,' Tome-se como exemplo o comportamento do papel de jornal: mantido a uma umidade estável de 50% e a uma temperatura estável de 20°C, sua expectativa de vida chega aos 45 anos, mas se a temperatura for reduzida para 12°C, mantendo-se a mesma umidade de 50%, teria sua expectativa de vida aumentada para 225 anos.',84,'2015-01-04 00:00:00','04:42:00',7),(232,137,' Fotografias coloridas, por sua vez, exigem temperaturas de 2°C e umidade a 30%.',14,'2014-07-24 00:00:00','10:54:00',6),(233,78,' Para acervos mistos uma temperatura entre 17 e 20°C e umidade entre 30 e 50% são aceitáveis.',11,'2014-12-15 00:00:00','20:33:00',8),(234,49,' A flutuação diária permitida fica em torno de 2°C na temperatura e de 5% na umidade, mas vários autores recomendam níveis de flutuação ainda menores, pois as variações são mais danosas do que níveis absolutos extremos.',98,'2014-03-13 00:00:00','22:07:00',7),(235,130,' Entretanto, estes também devem ser evitados.',15,'2014-09-27 00:00:00','03:19:00',7),(236,77,' Em combinação com alta umidade as reações se tornam ainda mais rápidas.',71,'2014-10-04 00:00:00','11:36:00',6),(237,59,' Temperaturas e umidades baixas, desta forma, são em geral preferíveis.',41,'2014-09-30 00:00:00','04:43:00',7),(238,162,' Por outro lado, alguns materiais não toleram bem temperaturas muito frias, outros não resistem em umidades muito baixas.',68,'2014-12-05 00:00:00','04:49:00',7),(239,97,' É portanto necessário um conhecimento aprofundado sobre o comportamento dos variados materiais que compõem determinado acervo a fim de estabelecer parâmetros de conservação adequados a cada caso.',41,'2015-01-29 00:00:00','00:33:00',9),(240,130,'A iluminação também é causa de grande degradação de certos materiais, tanto pela intensidade como pela duração da exposição à luz e pelo tipo de radiação, e por este motivo é estritamente controlada.',42,'2014-07-23 00:00:00','17:15:00',7),(241,148,' Esta questão se torna especialmente relevante nas mostras públicas de longa duração, devendo-se evitar ao máximo fontes emissoras de radiação ultravioleta - a maior causa de danos pela luz - ou usando filtros, e adequando os níveis de iluminação para as necessidades de cada tipo de material exposto.',85,'2014-04-13 00:00:00','22:59:00',4),(242,39,' Por exemplo, têxteis coloridos e papéis só admitem iluminação muito fraca, no máximo de 50 lux.',31,'2014-10-03 00:00:00','21:56:00',2),(243,2,' Peças construídas inteiramente em metal, pedra ou vidro, por outro lado, são na maior parte das vezes praticamente imunes aos efeitos da luz e admitem iluminação abundante - salvo se apresentarem pigmento superficial.',96,'2014-06-10 00:00:00','11:49:00',5),(244,177,' É importante entender que a iluminação exerce seus efeitos deletérios sobre os materiais sensíveis desde o primeiro instante de exposição, ainda que a deterioração possa não aparecer de imediato, e tais efeitos são cumulativos e irreversíveis.',68,'2014-07-24 00:00:00','22:01:00',8),(245,57,'A conservação preventiva e o restauro são, em todos os casos, sem exceção, trabalhos para um profissional especializado, pois trata-se de atividades científicas de grande complexidade, requerendo amplos conhecimentos de física, química, biologia, estética, história, e uma grande variedade de campos diferentes de saber conforme sua especialização e a área de atividade de sua instituição.',80,'2014-03-29 00:00:00','23:23:00',4),(246,138,' Este profissional, o conservador/restaurador, além de desempenhar suas tarefas específicas - quais sejam: prevenir danos e repará-los quando surgirem - participa da administração do museu contribuindo decisivamente na elaboração da política de aquisições de novas peças e na definição dos programas de climatização e segurança da casa.',104,'2014-07-07 00:00:00','15:03:00',4),(247,38,' Entre os problemas mais frequentes com que se deparam os conservadores/restauradores estão o envelhecimento natural de cada material, danos oriundos de acidentes, sinistros, vandalismo, climatização inadequada ou poluição, e ataques de agentes biológicos como fungos, roedores, traças e cupins.',55,'2014-11-02 00:00:00','23:29:00',8),(248,154,' Nenhuma peça é restaurada por pessoa desqualificada, ou que tenha feito algum curso rápido, ou que tenha aprendido suas técnicas via internet, pois na vasta maioria dos casos ela produz mais danos do que benefícios, e danos muitas vezes irreversíveis.',99,'2014-09-22 00:00:00','05:41:00',7),(249,174,' Muitos museus pequenos não contam com um restaurador em seu quadro, e se torna assim necessária a contratação externa deste serviço.',8,'2014-08-03 00:00:00','01:13:00',4),(250,76,' O restaurador deve ser escolhido por sua reputação, credenciais e currículo, que devem ser checados pela administração do museu com cuidado.',1,'2014-12-22 00:00:00','07:21:00',3),(251,100,'Dado o alto valor monetário de muitos acervos, os especialistas desenvolvem constantemente novas estratégias de segurança, e não é raro que haja segurança armada dentro das galerias, mesmo assim, as notícias de roubo, furto ou depredação de objetos colecionados são comuns.',67,'2014-07-10 00:00:00','14:44:00',5),(252,41,' Os museólogos recomendam que o museu elabore um completo programa de segurança que envolva todos os funcionários mas permaneça sigiloso para o público, e que inclua a proteção dos itens nos depósitos, galerias e viagens contra roubos, furtos, vandalismo, acidentes e sinistros, e preveja as medidas a serem tomadas em casos emergenciais.',69,'2014-10-14 00:00:00','05:16:00',6),(253,162,' Museus bem amparados financeiramente podem instalar sofisticados sistemas de segurança, que incluem circuito interno de TV, detectores de metais nas entradas e saídas, detectores de incêndio e alagamento, sensores de movimento e vários tipos de alarmes, além de um corpo de segurança especialmente treinado de prontidão 24h por dia.',42,'2014-11-10 00:00:00','12:27:00',6),(254,93,' Nos problemas de segurança relativos ao público em geral, um dos que mais se destaca é o vandalismo involuntário.',9,'2014-11-10 00:00:00','18:39:00',5),(255,112,' Muitas vezes, desinformadas e apenas por curiosidade, as pessoas tocam nas peças expostas, mas muitas delas podem ser extremamente frágeis, e não suportam toque ou manuseio, outras, mesmo resistentes, se impregnam das sujidades, suor e gordura das mãos que as tocam, o que se torna muito grave para a conservação do material se o toque for repetitivo, ou podem ser vítimas de acidente: um escorregão basta para um desastre, onde não só a peça pode se danificar de modo irremediável, como a pessoa envolvida, se ferir com gravidade.',36,'2014-10-09 00:00:00','13:21:00',4),(256,77,' Algumas peças de arte contemporânea, ou as de museus com acervos interativos, por outro lado, podem ser tocadas, geralmente sob a supervisão de um monitor.',66,'2014-09-06 00:00:00','01:21:00',2),(257,169,'41 42 24 Por outro lado, o vandalismo intencional de patrimônio público ou privado é crime, e é punido pela lei.',79,'2014-06-19 00:00:00','07:49:00',1),(258,32,'Ação educativa dirigida a escolares em uma exposição',48,'2014-12-12 00:00:00','06:59:00',6),(259,23,'A exibição de um acervo é um processo tão complexo quanto sua conservação no depósito, envolve direta ou indiretamente todos os funcionários da instituição, mas é praticamente a única parte das atividades museais que o grande público pode conhecer, e por isso constitui o cartão de visitas do museu.',32,'2014-05-03 00:00:00','23:27:00',8),(260,51,' Além disso, o contato direto com as peças é o momento maior em que se efetiva a verdadeira educação do público, a qual se constitui num dos objetivos primários da exposição e do próprio museu.',64,'2014-08-10 00:00:00','14:14:00',10),(261,133,' Isso posto, a tendência atual é de que todas as exposições sejam organizadas com objetividade e clareza, sob um planejamento curatorial decididamente voltado para a educação, devidamente identificando as peças e contextualizando o material exposto com informações ricas e exatas, mas acessíveis ao visitante médio, e providenciando ações educativas complementares variadas.',86,'2015-03-01 00:00:00','03:47:00',8),(262,175,' As exposições podem ser de longa duração, de curta duração, virtuais, ou extra-muros, onde se incluem as itinerâncias.',77,'2014-11-27 00:00:00','09:19:00',3),(263,71,'Uma mostra, para ser culturalmente bem sucedida, não pode ser improvisada, na verdade uma exposição memorável, que justifique os altíssimos gastos públicos com os museus, é um trabalho coletivo de grande escala, longo alcance e de cunho científico, e implica muita pesquisa cultural, produção de materiais acessórios como publicações, e minucioso planejamento logístico, incluindo roteiro de marketing e divulgação na mídia, um processo iniciando meses, ou até anos, conforme o porte da mostra, antes da data de inauguração, e continuando por algum tempo depois no processo de avaliação de resultados.',83,'2014-08-20 00:00:00','13:25:00',7),(264,88,' Requer do museu também um bom conhecimento do perfil do seu público - e para isso são úteis pesquisas de opinião e estatísticas -, sem desconsiderar as exigências de uma proposta pedagógica de alto nível.',89,'2014-05-12 00:00:00','03:08:00',4),(265,71,' Museus com boa infraestrutura já produzem catálogos ilustrados e materiais gráficos e informativos para cada exposição, e mantêm websites com rico material disponível para consulta online, têm departamentos especiais para ação educativa, articulação com escolas e instituições culturais, acolhimento do visitante e monitoramento da visitação, oferecendo diversas opções de atividades paralelas, como oficinas, palestras, teatro, concertos, visitas guiadas, etc.',16,'2014-04-18 00:00:00','03:58:00',9),(266,163,'também fazendo programações diferenciadas para públicos particularizados, como estrangeiros, escolares, pessoas com necessidades especiais, crianças/adultos, leigos/especialistas, etc.',19,'2014-12-31 00:00:00','21:23:00',3),(267,114,'Faz parte dos programas educativos de muitos museus dar orientação ao público não só sobre o valor cultural dos acervos expostos, mas também sobre regras básicas de comportamento durante as visitas, o que usualmente inclui vários interditos, como a proibição de comer, beber, fumar, gritar, correr pelas salas, tocar nas peças, carregar sacolas, bolsas e objetos volumosos, fotografar, deixar crianças pequenas circularem desacompanhadas, etc.',3,'2014-09-28 00:00:00','17:17:00',7),(268,46,' Essa regulamentação pode às vezes parecer rígida demais, mas se destina à proteção do acervo tanto como das pessoas que o vão conhecer.',67,'2014-08-13 00:00:00','18:20:00',2),(269,159,' Porém os museus podem estabelecer seus próprios códigos de etiqueta para os visitantes, que são publicados em seus websites para conhecimento prévio dos interessados.',70,'2014-04-14 00:00:00','14:40:00',7),(270,116,'A exposição requer em linhas gerais os mesmos cuidados aplicados para o armazenamento dos itens na Reserva, na verdade, a sala de exposição deve ser concebida quase como uma segunda Reserva Técnica, de uso temporário, já que nada adianta se conservar um acervo com todo o cuidado na RT e em seguida transportá-lo para uma galeria onde enfrentará penosamente as oscilações do clima.',28,'2014-05-14 00:00:00','19:01:00',3),(271,107,' A climatização nas galerias, por isso, se aproxima à da Reserva e funciona 24h por dia.',107,'2014-05-01 00:00:00','15:54:00',4),(272,1,' Exposições de longa duração podem ser particularmente problemáticas pela continuada exposição das peças à luz e a condições ambientais tornadas instáveis pelo afluxo variável de público, cujos corpos emitem consideráveis quantidades de umidade e calor.',110,'2014-05-18 00:00:00','21:29:00',1),(273,66,' Museus que guardam acervos de objetos especialmente sensíveis podem ser obrigados a montar exposições frias ou penumbrosas demais para o gosto do público.',75,'2014-11-20 00:00:00','22:52:00',10),(274,114,' Todo esse campo está em rápida expansão e contínua transformação.',26,'2014-08-21 00:00:00','00:00:00',7),(275,177,' Em combinação com alta umidade as reações se tornam ainda mais rápidas.',89,'2014-11-07 00:00:00','08:45:00',7),(276,171,' Temperaturas e umidades baixas, desta forma, são em geral preferíveis.',96,'2014-04-24 00:00:00','08:04:00',7),(277,89,' Por outro lado, alguns materiais não toleram bem temperaturas muito frias, outros não resistem em umidades muito baixas.',87,'2014-11-16 00:00:00','07:14:00',10),(278,40,' É portanto necessário um conhecimento aprofundado sobre o comportamento dos variados materiais que compõem determinado acervo a fim de estabelecer parâmetros de conservação adequados a cada caso.',75,'2015-03-26 00:00:00','07:16:00',2),(279,118,' As fichas podem, por outro lado, considerando a atualização constante de certas categorias de dados, ser impressas apenas como um formulário básico, a ser preenchido à mão e eventualmente corrigido se necessário, mas todas as informações do registro informatizado devem ser transportadas para as fichas, não pode haver discrepância entre as duas versões documentais.',11,'2014-09-23 00:00:00','09:25:00',6),(280,126,' É possível também fazer o caminho inverso: tomar as fichas como registro primário e só depois levar os dados para o computador.',91,'2014-02-16 00:00:00','20:19:00',8),(281,47,' Cada instituição deve decidir o método de registro como lhe parecer mais prático, completo e seguro.',8,'2014-11-22 00:00:00','05:45:00',5),(282,62,' É sobremaneira importante reunir todos os dados possíveis no momento da coleta ou aquisição, pois mais tarde pode ser impossível obtê-los.',34,'2014-07-19 00:00:00','09:50:00',7),(283,68,' Considerando os documentos como registros da atividade humana, a documentação serve como instrumento de comunicação e preservação da informação no âmbito da memória social e da pesquisa científica.',48,'2015-02-20 00:00:00','18:53:00',8),(284,89,'Um modelo de Livro-Tombo',34,'2014-07-13 00:00:00','17:05:00',10),(285,129,'Na catalogação do acervo as informações são compiladas de uma variedade de documentos relacionados a cada peça do acervo, como fotografias, laudos de conservação, fichas descritivas, atestados de participação da peça em exposições, contratos de aquisição, etc',58,'2014-10-14 00:00:00','22:32:00',6),(286,58,'Detalhe de um catálogo digitalizado',55,'2014-09-28 00:00:00','01:17:00',1),(287,149,'O catálogo inclui pelo menos um documento básico: o livro-tombo (LT), mas ele raramente é suficiente na dinâmica de um museu contemporâneo, e precisa ser complementado por um sistema auxiliar, geralmente um arquivo informatizado e/ou fichas impressas.',90,'2014-09-01 00:00:00','11:57:00',7),(288,108,'Peças do acervo do Museu do Brinquedo de Zurique',103,'2014-05-14 00:00:00','02:40:00',7),(289,167,'A criação e manutenção de um acervo museológico é uma tarefa trabalhosa, dispendiosa, complexa e ainda em processo de estudo e aperfeiçoamento.',74,'2014-12-01 00:00:00','09:55:00',8),(290,123,' Muitas questões fundamentais ainda estão sendo discutidas pelos especialistas, e em muitas delas ainda não se formaram consensos ou regulamentações definitivas.',69,'2014-06-26 00:00:00','21:20:00',4);
