INSERT INTO `evento` VALUES (1,'10 Carnaval de Rua ',' Do mesmo modo, o aumento do mercado de antiguidades proporcionou a restauração de obras antigas caras a sua posterior comercialização.','2014-02-21 00:00:00','2014-02-22 00:00:00',4,2),(2,'10 Carnaval nas Àguas ',' Por último, a escultura tem sido uma evolução paralela: desde a reconstrução de obras antigas, geralmente em relação a membros mutilados (como a reconstrução do Laocoonte em 1523-1533 por parte de Giovanni Angelo Montorsoli), até a atuação sobre a obra preservando sua estrutura original, mantendo em caso necessário um certo grau de reversibilidade da ação praticada.','2014-03-01 00:00:00','2014-03-04 00:00:00',4,106),(3,'10ª Chapadafest Feira ','Em 1985, iniciou-se a construção de um ginásio multiesportivo totalizando 4,000 m².\n\nEnquanto a obra estava em desenvolvimento, uma equipe trabalhava para organizar a primeira edição da Festa. Depois de escolhido o nome do evento, que passou a se denominar ChapadaFest, foi feito uma visita a OktoberFest de Santa Cruz do Sul-RS, com a finalidade de coletar sugestões.\n\nO ato inaugural do Ginásio Municipal 3 de Junho culminou com a 1ª ChapadaFest, realizada nos dias 19 e 20 de janeiro de 1990, que tinha por objetivo manter viva a tradição alemã; conservando as tradições dos primeiros imigrantes estabelecidos na região desde 1918, que aos poucos estava se perdendo nas comunidades. Essas tradições foram então transportadas para a realidade atual, através da música nos bailes de salão, da comida, dos trajes, do chope, das flores, do clima de festa e de alegria contagiando a todos.','2014-01-15 00:00:00','2014-01-19 00:00:00',2,113),(4,'10ª Festa da Laranja ','A 10ª edição da tradicional Festa da Laranja com Açúcar reúne comidas típicas e shows a partir desta sexta-feria (27) e até domingo (29) no Campo do Serse, no distrito Santa Eudóxia, em São Carlos (SP). A expectativa da organização é receber cerca de 20 mil pessoas','2014-06-27 00:00:00','2014-07-01 00:00:00',5,51),(5,'10ª Festa do Pinhão e 11ª Expofeira ','A Festa Nacional do Pinhão é uma evento gastronômico e cultural realizado na cidade brasileira de Lages, no estado de Santa Catarina.','2014-05-28 00:00:00','2014-07-01 00:00:00',5,39),(6,'10ª Trilha Cuca 4X4 ','A 10ª Trilha da Cuca, que faz parte da programação de aniversário de Rolante, será composta por um trajeto de cerca de 35 quilômetros - passando por banhado e dificuldades ao longo do percurso.','2014-04-12 00:00:00','2014-04-19 00:00:00',3,59),(7,'11ª Envase Brasil 2014 ','A escolha da data foi apontada para o mês de Janeiro, no período de férias, para não comprometer nenhum outro evento da região.','2014-04-08 00:00:00','2014-04-11 00:00:00',8,17),(8,'11ª Festa do Arroz ','A primeira edição ocorreu na década de 80, como uma mostra de campo, denominada Festa do Interior, constituída por boxes típicos de costaneiras cobertos de esteiras e taquaras, folhas de xaxim e até mesmo de butiazeiros.','2014-04-19 00:00:00','2014-04-20 00:00:00',5,25),(9,'12 Bivaque da Poesia Gaúcha, 13 Acampamento da Canção Gaúcha, 1 Acampamentinho da','O Bivaque da Poesia Gaúcha, que ocorrerá em 28 de fevereiro, dia que serão conhecidos os vencedores, é um tradicional concurso de poesias que reúne em Campo Bom os principais compositores, declamadores e amadrinhadores do RS. O concurso é uma promoção da Administração Municipal em parceria com entidades tradicionalistas com o intuito de integrar a comunidade ao movimento tradicionalista gaúcho por meio do verso e de abrir novos espaços para poetas e declamadores, além de divulgar a arte e cultura gaúcha através da poesia. Para a realização do evento, a Administração conta com o apoio do CTG M’Bororé.','2014-09-06 00:00:00','2014-09-08 00:00:00',3,58),(10,'12 Rodeio Crioulo Estadual ','O grupo de Artes Nativas Anita Garibaldi, 24ª RT, e o poder público municipal de Encantado, tem o imenso prazer em contar com sua presença nos dias 15, 16 e 17 de agosto de 2014, no Parque João Batista Marchese, quando estaremos de porteiras abertas para receber com muita honra a todos os tradicionalistas e simpatizantes da arte e tradição gaúcha no grande RODEIO CRIOULO ESTADUAL do G.A.N. Anita Garibaldi.','2014-03-14 00:00:00','2014-03-16 00:00:00',2,13),(11,'12ª Encenação da Paixão de Cristo ','A 12ª Encenação da Paixão de Cristo aconteceu no dia 06 de abril, na Paróquia de todos os Santos localizada na Rua Capri, 53 – Jardim Santa Emilia, Embu das Artes e contou com a participação de muitos fiéis. Referencia na Forania de Embu, a encenação contou com a participação de 87 atores e 18 pessoas na organização. Agradecemos a Prefeitura de Embu das Artes que disponibilizou as cadeiras e ao vereador Professor Silvino juntamente com a Câmara Municipal. “O apoio acima de tudo é da Paróquia como um todo e o Padre Esmeraldo Diniz nos deu todo o apoio, também o Presidente da Câmara Vereador Profº Silvino, junto com a Rosana dos Santos Almeida. Foi por meio deles que conseguimos um palco com toda a estrutura e som. Tivemos também o apoio da Guarda Municipal e da Policia Militar. O elenco encenou com emoção e dedicação a passagem de Jesus Cristo na terra, morte e ressurreição. Em cena, os atores em grande maioria em palco pela primeira vez foram motivados pelo amor em Deus, e assim encenaram com respeito, atenção e dedicação cada passagem de Jesus Cristo levando o público estimado em 5 mil pessoas, com muita emoção e reflexão. A apresentação durou cerca de 4 horas. A abertura ficou por conta de um grupo coordenado  por Silvana Rodrigues, da Paróquia São Vicente de Paula e São Tiago Apostolo, o qual apresentou um número de pop espertando curiosidade nos expectadores. “Minhas expectativas são positivas com relação à abertura, ensaiamos bastante”, afirma Silvana Rodrigues. As cenas apresentadas na encenação foram do anuncio do anjo a Virgem Maria, batismo de Jesus Cristo, momentos de traição e negação pelos personagens bíblicos Judas e Pedro, morte e ressurreição que marca a alegria de 40 dias de penitência, silêncio e reflexão para os fieis católicos.','2014-04-17 00:00:00','2014-04-18 00:00:00',6,31),(12,'12ª Encenação da Paixão e Morte de Cristo ','A apresentação durou cerca de 4 horas. A abertura ficou por conta de um grupo coordenado  por Silvana Rodrigues, da Paróquia São Vicente de Paula e São Tiago Apostolo, o qual apresentou um número de pop espertando curiosidade nos expectadores. “Minhas expectativas são positivas com relação à abertura, ensaiamos bastante”, afirma Silvana Rodrigues. As cenas apresentadas na encenação foram do anuncio','2014-04-18 00:00:00','2014-04-21 00:00:00',6,24),(13,'12ª Festa de Nossa Senhora de Lourdes ','Nossa Senhora de Lourdes é o nome usado para se referir à aparição mariana que teria sido presenciada por várias pessoas em ocasiões distintas, em torno de Lourdes, França. Ocorreu no ano previsto por Nossa Senhora em La Salette, França em 1846, doze anos antes.','2014-02-06 00:00:00','2014-02-09 00:00:00',6,70),(14,'12ª Polfest e 2ª Mostra do Empreendedor ','Cultura (do latim colere, que significa cultivar) é um conceito de várias acepções, sendo a mais corrente a definição genérica formulada por Edward B.','2014-05-24 00:00:00','2014-05-27 00:00:00',8,97),(15,'13 Chocomel e 16 Feira do Livro ',' Tylor, segundo a qual cultura é todo aquele complexo que inclui o conhecimento, as crenças, a arte, a moral, a lei, os costumes e todos os outros hábitos e capacidades adquiridos pelo homem como membro da sociedade 1 2 .','2014-04-17 00:00:00','2014-04-19 00:00:00',7,45),(16,'13 Fusca Fest ',' Em Roma, na língua latina, seu antepassado etimológico tinha o sentido de agricultura (significado que a palavra mantém ainda hoje em determinados contextos), como empregado por Varrão, por exemplo.','2014-03-09 00:00:00','2014-03-15 00:00:00',7,60),(17,'138ª Festa de São Sebastião Mártir ','3 Cultura é também associada, comumente, a altas formas de manifestação artística e/ou técnica da humanidade, como a música erudita europeia (o termo alemão Kultur – cultura – se aproxima mais desta definição).','2014-01-18 00:00:00','2014-01-20 00:00:00',5,51),(18,'13ª Feira do Livro ','4 Definições de cultura foram realizadas por Ralph Linton, Leslie White, Clifford Geertz, Franz Boas, Malinowski e outros cientistas sociais.','2014-05-08 00:00:00','2014-05-10 00:00:00',7,8),(19,'13ª Fenachim ',' Em um estudo aprofundado, Alfred Kroeber e Clyde Kluckhohn encontraram pelo menos 167 definições diferentes para o termo cultura.','2014-05-01 00:00:00','2014-05-11 00:00:00',7,83),(20,'13ª Lagoafest ','Por ter sido fortemente associada ao conceito de civilização no século XVIII, a cultura muitas vezes se confunde com noções de: desenvolvimento, educação, bons costumes, etiqueta e comportamentos de elite.','2014-03-20 00:00:00','2014-03-23 00:00:00',3,60),(21,'13ª Olimpíada Rural ',' Essa confusão entre cultura e civilização foi comum, sobretudo, na França e na Inglaterra dos séculos XVIII e XIX, onde cultura se referia a um ideal de elite.','2014-03-16 00:00:00','2014-03-21 00:00:00',6,6),(22,'13ª Suinofest ','4 Ela possibilitou o surgimento da dicotomia (e, eventualmente, hierarquização) entre cultura erudita e cultura popular, melhor representada nos textos de Matthew Arnold, ainda fortemente presente no imaginário das sociedades ocidentais.','2014-07-06 00:00:00','2014-07-15 00:00:00',3,27),(23,'14 Fenegócios ','Diversos sentidos da palavra variam consoante a aplicação em determinado ramo do conhecimento humano.','2014-05-01 00:00:00','2014-05-04 00:00:00',8,111),(24,'14 Rodeio Internacional ','Agricultura – acepção original do termo cultura, que se refere ao cultivo da terra para produção de espécies vegetais úteis ao consumo do homem.','2014-01-16 00:00:00','2014-01-19 00:00:00',2,107),(25,'14ª Expoagro Afubra ','Ciências sociais - Do ponto de vista das ciências sociais (isto é, da sociologia e da antropologia), sobretudo conforme a formulação de Tylor, a cultura é um conjunto de ideias, comportamentos, símbolos e práticas sociais artificiais (isto é, não naturais ou biológicos) aprendidos de geração em geração por meio da vida em sociedade.','2014-03-25 00:00:00','2014-03-27 00:00:00',5,81),(26,'14ª Expocace ','7 Essa definição geral pode sofrer mudanças de acordo com a perspectiva teórica do sociólogo ou antropólogo em questão.','2014-03-13 00:00:00','2014-03-16 00:00:00',5,92),(27,'14ª Exposol – Exposição Feira ',' De acordo com Ralph Linton, como termo geral, cultura significa a herança social e total da Humanidade, como termo específico, uma cultura significa determinada variante da herança social.','2014-05-01 00:00:00','2014-05-04 00:00:00',6,41),(28,'14ª Festa de São José e Novena Móvel ',' Assim, cultura, como um todo, compõe-se de grande número de culturas, cada uma das quais é característica de um certo grupo de indivíduos8 Enquanto a definição de Tylor é muito genérica, podendo causar confusão quando se propõe uma reflexão mais aprofundada do que é cultura, outras definições são mais restritivas.','2014-03-07 00:00:00','2014-03-16 00:00:00',8,45),(29,'14ª Via Sacra ',' Os autores debatem se o termo se refere mais corretamente a ideias (Boas, Malinowski, Linton), comportamentos (Kroeber) ou simbolização de comportamento, incluindo a cultura material (L. White).','2014-04-18 00:00:00','2014-04-22 00:00:00',4,26),(30,'15 Santiago Aberto de Tênis ','9 Vale lembrar que, em algumas concepções de cultura, o comportamento é apenas biológico, sendo a cultura a forma como esse conjunto de fatores biológicos se apresentam nas sociedades humanas.','2014-03-15 00:00:00','2014-03-31 00:00:00',7,11),(31,'15ª Cavalgada Cultural da Costa Doce ',' Em outras concepções (como onde cultura é entendida como conjunto de ideias), cultura exclui os registros materiais dos homens como tais da classificação (ex.','2014-01-16 00:00:00','2014-01-26 00:00:00',8,27),(32,'15ª Expodireto Cotrijal ',' um sofá ou uma mesa não seriam cultura) – posição fortemente criticada por White.','2014-03-10 00:00:00','2014-03-14 00:00:00',8,80),(33,'15ª Festa de Nossa Senhora dos Navegantes ','Filosofia - cultura é o conjunto de manifestações humanas que contrastam com a natureza ou comportamento natural.','2014-02-02 00:00:00','2014-02-09 00:00:00',7,74),(34,'15ª Semana do Bebê ',' Por seu turno, em biologia uma cultura é normalmente uma criação especial de organismos (em geral microscópicos) para fins determinados (por exemplo: estudo de modos de vida bacterianos, estudos microecológicos, etc.','2014-05-11 00:00:00','2014-05-18 00:00:00',2,72),(35,'16 Copa Integração de Esportes ','No dia-a-dia das sociedades civilizadas (especialmente a sociedade ocidental) e no vulgo costuma ser associada à aquisição de conhecimentos e práticas de vida reconhecidas como melhores, superiores, ou seja, erudição, este sentido normalmente se associa ao que é também descrito como alta cultura, e é empregado apenas no singular (não existem culturas, apenas uma cultura ideal, à qual os homens indistintamente devem se enquadrar).','2014-04-26 00:00:00','2014-04-27 00:00:00',2,110),(36,'16 Fespemm - Festa do Peixe ',' Dentro do contexto da filosofia, a cultura é um conjunto de respostas para melhor satisfazer as necessidades e os desejos humanos.','2014-05-10 00:00:00','2014-05-15 00:00:00',1,93),(37,'16ª Festa do Mar ',' Cultura é informação, isto é, um conjunto de conhecimentos teóricos e práticos que se aprende e transmite aos contemporâneos e aos vindouros.','2014-04-10 00:00:00','2014-04-20 00:00:00',3,108),(38,'17 Carnaval Binacional ',' A cultura é o resultado dos modos como os diversos grupos humanos foram resolvendo os seus problemas ao longo da história.','2014-03-15 00:00:00','2014-03-16 00:00:00',5,31),(39,'17 Moto Lagoa ',' Cultura é criação.','2014-03-28 00:00:00','2014-03-30 00:00:00',2,18),(40,'17 Rally Internacional ',' O homem não só recebe a cultura dos seus antepassados como também cria elementos que a renovam.','2014-05-15 00:00:00','2014-05-18 00:00:00',1,56),(41,'18ª Fenarroz',' A cultura é um fator de humanização.','2014-05-20 00:00:00','2014-05-25 00:00:00',5,59),(42,'18ª Festa do Pinhão ',' O homem só se torna homem porque vive no seio de um grupo cultural.','2014-07-05 00:00:00','2014-07-15 00:00:00',1,48),(43,'18ª Kuchenfest ',' A cultura é um sistema de símbolos compartilhados com que se interpreta a realidade e que conferem sentido à vida dos seres humanos.','2014-03-07 00:00:00','2014-03-09 00:00:00',4,80),(44,'19 Acampamento da Arte Gaúcha ','Antropologia - esta ciência entende a cultura como o totalidade de padrões aprendidos e desenvolvidos pelo ser humano.','2014-01-02 00:00:00','2014-01-05 00:00:00',2,24),(45,'19 Festa do Agricultor ',' Segundo a definição pioneira de Edward Burnett Tylor, sob a etnologia (ciência relativa especificamente do estudo da cultura) a cultura seria o complexo que inclui conhecimento, crenças, arte, morais, leis, costumes e outras aptidões e hábitos adquiridos pelo homem como membro da sociedade.','2014-05-24 00:00:00','2014-05-25 00:00:00',3,102),(46,'19ª Movelsul Brasil 2014 ',' Portanto corresponde, neste último sentido, às formas de organização de um povo, seus costumes e tradições transmitidas de geração para geração que, a partir de uma vivência e tradição comum, se apresentam como a identidade desse povo.','2014-03-24 00:00:00','2014-03-28 00:00:00',1,25),(47,'20 Carnaval de Rua ','O uso de abstração é uma característica do que é cultura: os elementos culturais só existem na mente das pessoas, em seus símbolos tais como padrões artísticos e mitos.','2014-02-28 00:00:00','2014-03-02 00:00:00',5,105),(48,'20 Mercosul Open de Tênis ',' Entretanto fala-se também em cultura material (por analogia a cultura simbólica) quando do estudo de produtos culturais concretos (obras de arte, escritos, ferramentas, etc.','2014-05-23 00:00:00','2014-05-25 00:00:00',4,112),(49,'20 Rodeio Internacional do Cone Sul ','Essa forma de cultura (material) é preservada no tempo com mais facilidade, uma vez que a cultura simbólica é extremamente frágil.','2014-03-06 00:00:00','2014-03-09 00:00:00',2,101),(50,'20ª Fenasoja ','A principal característica da cultura é o chamado mecanismo adaptativo: a capacidade de responder ao meio de acordo com mudança de hábitos, mais rápida do que uma possível evolução biológica.','2014-04-25 00:00:00','2014-05-04 00:00:00',3,72),(51,'20ª Sagra del Porco e Doce Gauchesco ',' O homem não precisou, por exemplo, desenvolver longa pelagem e grossas camadas de gordura sob a pele para viver em ambientes mais frios – ele simplesmente adaptou-se com o uso de roupas, do fogo e de habitações.','2014-02-27 00:00:00','2014-03-04 00:00:00',5,21),(52,'21ª Feira do Livro Josué Guimarães ',' A evolução cultural é mais rápida do que a biológica.','2014-07-03 00:00:00','2014-07-08 00:00:00',4,67),(53,'21ª Supermaratona 50km ',' No entanto, ao rejeitar a evolução biológica, o homem torna-se dependente da cultura, pois esta age em substituição a elementos que constituiriam o ser humano, a falta de um destes elementos (por exemplo, a supressão de um aspecto da cultura) causaria o mesmo efeito de uma amputação ou defeito físico, talvez ainda pior.','2014-03-16 00:00:00','2014-03-19 00:00:00',8,83),(54,'22 Romaria de Santo Expedito ','Além disso a cultura é também um mecanismo cumulativo.','2014-04-25 00:00:00','2014-04-27 00:00:00',4,2),(55,'22ª Expofax, 10ª Expocolônia, 13ª Mostra de Gado Leiteiro ',' As modificações trazidas por uma geração passam à geração seguinte, de modo que a cultura transforma-se perdendo e incorporando aspectos mais adequados à sobrevivência, reduzindo o esforço das novas gerações.','2014-05-02 00:00:00','2014-05-04 00:00:00',2,35),(56,'22ª Fenadoce ','Um exemplo de vantagem obtida através da cultura é o desenvolvimento do cultivo do solo, a agricultura.','2014-07-04 00:00:00','2014-07-22 00:00:00',6,38),(57,'23 Festival de Voo Livre ',' Com ela o homem pôde ter maior controle sobre o fornecimento de alimentos, minimizando os efeitos de escassez de caça ou coleta.','2014-03-08 00:00:00','2014-03-09 00:00:00',2,95),(58,'23 Festival Estadual de Esquetes Teatrais ',' Também pôde abandonar o nomadismo, daí a fixação em aldeamentos, cidades e estados.','2014-07-10 00:00:00','2014-07-15 00:00:00',3,102),(59,'24 Expobento 2014 ','A agricultura também permitiu o crescimento populacional de maneira acentuada, que gerou novo problema: produzir alimento para uma população maior.','2014-07-05 00:00:00','2014-07-15 00:00:00',2,43),(60,'24ª Páscoa em Canela ',' Desenvolvimentos técnicos – facilitados pelo maior número de mentes pensantes – permitem que essa dificuldade seja superada, mas por sua vez induzem a um novo aumento da população, o aumento populacional é assim causa e consequência do avanço cultural .','2014-04-04 00:00:00','2014-04-20 00:00:00',2,110),(61,'24ª Tafona da Canção Nativa ','A cultura é dinâmica.','2014-05-30 00:00:00','2014-05-31 00:00:00',6,60),(62,'25 Bolamar ',' Como mecanismo adaptativo e cumulativo, a cultura sofre mudanças.','2014-01-18 00:00:00','2014-02-16 00:00:00',1,91),(63,'25 Rodeio Crioulo Estadual ',' Traços se perdem, outros se adicionam, em velocidades distintas nas diferentes sociedades.','2014-01-10 00:00:00','2014-01-12 00:00:00',2,38),(64,'25ª Feira do Peixe e do Artesanato 2014 ','Dois mecanismos básicos permitem a mudança cultural: a invenção ou introdução de novos conceitos, e a difusão de conceitos a partir de outras culturas.','2014-04-11 00:00:00','2014-04-18 00:00:00',2,102),(65,'25ª Fejunca - Festa Junina do Cassino ',' Há também a descoberta, que é um tipo de mudança cultural originado pela revelação de algo desconhecido pela própria sociedade e que ela decide adotar.','2014-07-05 00:00:00','2014-07-08 00:00:00',5,57),(66,'25ª Festa Nacional do Peixe ','A mudança acarreta normalmente em resistência.','2014-06-12 00:00:00','2014-07-13 00:00:00',7,50),(67,'25ª Festimalha ',' Visto que os aspectos da vida cultural estão ligados entre si, a alteração mínima de somente um deles pode ocasionar efeitos em todos os outros.','2014-05-01 00:00:00','2014-07-01 00:00:00',8,112),(68,'26 Carnaval e Desfiles de Escolas de Samba ',' Modificações na maneira de produzir podem, por exemplo, interferir na escolha de membros para o governo ou na aplicação de leis.','2014-03-01 00:00:00','2014-03-04 00:00:00',5,63),(69,'26ª Copa Santiago de Futebol Juvenial ','A resistência à mudança representa uma vantagem, no sentido de que somente modificações realmente proveitosas, e que sejam por isso inevitáveis, serão adotadas evitando o esforço da sociedade em adotar, e depois rejeitar um novo conceito.','2014-01-10 00:00:00','2014-01-25 00:00:00',6,65),(70,'26ª Fenovinos ','O ambiente exerce um papel fundamental sobre as mudanças culturais, embora não único: os homens mudam sua maneira de encarar o mundo tanto por contingências ambientais quanto por transformações da consciência social.','2014-05-14 00:00:00','2014-05-18 00:00:00',4,54),(71,'26ª Temporada de Inverno ','É possível, na opinião de alguns cientistas, identificar uma espécie de cultura em alguns animais superiores, especialmente mamíferos (e dentro destes, especialmente primatas).','2014-05-27 00:00:00','2014-07-27 00:00:00',8,66),(72,'29 Campeonato Regional de Futebol de Salão ','De acordo com Andrew Whiten, Kathy Schick e Nichobs Tolh, os chimpanzés possuem um rico repertório de ferramentas (clavas, perfuradores, etc.','2014-06-30 00:00:00','2014-09-05 00:00:00',8,72),(73,'29 Rodeio Crioulo ','10 A técnica de produção de ferramentas, além de sua forma de uso, é ensinada de geração em geração entre os chimpanzés.','2014-01-17 00:00:00','2014-01-19 00:00:00',2,62),(74,'2ª Cuca Bike ',' Algo semelhante ocorre com os primatas Bonobos.','2014-03-09 00:00:00','2014-03-13 00:00:00',7,118),(75,'2ª Feira Binacional de Páscoa ','11 A existência da produção de cultura material e transmissão desta cultura socialmente é, dentro de algumas concepções de cultura, suficiente para