ntensificar nossa visão de mundo em uma obra coerente e significativa.','2014-05-01 00:00:00','2014-05-04 00:00:00',2,59),(127,'7 Concurso Internacional de Vinhos do Brasil ','Na primeira metade do século XX conceitos inovadores foram introduzidos pela Escola de Frankfurt, destacando-se Walter Benjamin e Theodor Adorno, estudando os efeitos da industrialização, da tecnologia e da cultura de massa sobre a arte.','2014-04-14 00:00:00','2014-04-17 00:00:00',4,13),(128,'7 Festival Nativista em Canto ',' Benjamin analisou a perda da aura do objeto artístico na sociedade contemporânea, e Adorno refletiu que a arte não é um reflexo mecânico da sociedade que a produz, pois a arte expressa o que não existe e indica a possibilidade de transformação e transcendência.','2014-04-11 00:00:00','2014-04-13 00:00:00',1,100),(129,'7 Rodeio Internacional ',' Representante do pragmatismo, John Dewey definiu a arte como a culminação da natureza, defendendo que a base da estética é a experiência sensorial.','2014-02-12 00:00:00','2014-02-16 00:00:00',2,16),(130,'7 Verão em Antônio Prado ',' A atividade artística seria uma consequência da atividade natural do ser humano, cuja forma organizativa depende dos condicionamentos ambientais em que se desenvolve.','2014-02-11 00:00:00','2014-03-30 00:00:00',2,73),(131,'7 Verão no Jardim da Serra Gaúcha ',' Assim, arte seria o mesmo que expressão, onde fins e meios se fundem em una experiência agradável.','2014-01-11 00:00:00','2014-03-09 00:00:00',1,67),(132,'7° Canto Missioneiro da Música Nativa e 6° Canto Piá Missioneiro ',' Já Ortega y Gasset apontou o caráter elitista e a desumanização da arte de vanguarda, devido ao seu hermetismo, ao repúdio da imitação da natureza e à perda da perspectiva histórica.','2014-03-27 00:00:00','2014-03-29 00:00:00',2,66),(133,'79ª Festa da Uva ',' Na escola semiótica, Luigi Pareyson elaborou uma estética hermenêutica, onde arte é a interpretação da verdade.','2014-01-24 00:00:00','2014-01-26 00:00:00',5,61),(134,'79ª Romaria da Gruta Nossa Senhora de Lourdes ',' Para ele, a arte é formativa, ou seja, expressa uma forma de fazer que ao mesmo tempo inventa sua própria linguagem e seus meios.','2014-02-08 00:00:00','2014-02-09 00:00:00',6,39),(135,'79ª Romaria Nossa Senhora de Lourdes ',' Assim a arte não seria o resultado de um projeto predeterminado, mas simplesmente encontraria o resultado no processo de fazer.','2014-02-08 00:00:00','2014-02-09 00:00:00',6,13),(136,'7ª Feira de Terneiros, Terneiras e Vaquilhonas ',' Pareyson influenciou a chamada Escola de Turim, que desenvolveu o conceito ontológico de arte.','2014-04-26 00:00:00','2014-04-29 00:00:00',3,21),(137,'7ª Festa do Búfalo e 5ª Expofeira ',' Umberto Eco, seu maior expoente, afirmou que a obra de arte só existe em sua interpretação, na abertura de múltiplos significados que pode ter para o espectador.','2014-03-20 00:00:00','2014-03-23 00:00:00',4,14),(138,'7ª Serra Grife 2014 ','A fonte, de Marcel Duchamp, originalmente um urinol: um exemplo da transformação contemporânea do conceito de arte','2014-04-05 00:00:00','2014-04-13 00:00:00',8,100),(139,'8 Carnaval Regional ','Chegando-se aos meados do século XX, o assunto se tornou tão complexo, volátil e subjetivo que muitos estudiosos abandonaram de todo a ideia de que a definição do que é arte é de alguma forma possível.','2014-02-28 00:00:00','2014-03-04 00:00:00',4,22),(140,'83ª Festa de Nossa Senhora dos Navegantes ',' A título de exemplo, cite-se algumas opiniões: Morris Weitz declarou que o próprio caráter aventuroso e expansivo da arte, suas constantes mutações e novidades, torna ilógico que estabeleçamos qualquer conjunto de propriedades definidas.','2014-02-02 00:00:00','2014-02-09 00:00:00',5,32),(141,'8ª Festa do Butiá ',' Robert Rosenblum disse que hoje em dia a ideia de definirmos arte é tão remota que não acredito que alguém teria coragem de fazê-lo, e Wladyslaw Tatarkiewicz afirmou que nosso século chegou à conclusão de que conseguirmos uma definição abrangente do que é arte é não apenas algo dificílimo, como impossível.','2014-03-13 00:00:00','2014-03-16 00:00:00',2,79),(142,'8ª Muamba Municipal ',' Essas visões, porém, não impediram que outros críticos lançassem opiniões diferentes, crendo ser possível uma definição.','2014-02-27 00:00:00','2014-03-05 00:00:00',8,41),(143,'9 Café de Cambona ',' Alguns delas contornaram o problema central da definição propriamente dita, e estabeleceram parâmetros externos para definir o fato artístico, recorrendo à consagração institucional, à autoridade, ou à resposta do público ou de pessoas consideradas peritas.','2014-05-25 00:00:00','2014-05-27 00:00:00',3,99),(144,'9 Carnaval na Areia ',' Um exemplo é a definição de George Dickie: um objeto artístico é em primeiro lugar um artefato, e em segundo, é um conjunto de aspectos que legitimou sua proposta de merecer atenção especial de alguma pessoa ou pessoas agindo em nome de alguma instituição social.','2014-03-01 00:00:00','2014-03-04 00:00:00',4,80),(145,'9 Festival da Uva e das Águas ',' Às vezes se recorre à sua localização e ao contexto cultural, como na declaração de Thomas McEvilley, dizendo que é arte o que está num museu.','2014-01-17 00:00:00','2014-01-19 00:00:00',8,84),(146,'9 Festival do Peixe ','Parece bem claro que hoje em dia mais ou menos qualquer coisa pode ser chamada de arte.','2014-03-21 00:00:00','2014-03-24 00:00:00',1,90),(147,'9 Jantar Típico Polonês ',' A questão é: ela foi chamada de arte pelo sistema de arte? Em nosso século, isso é tudo o que é preciso para definir arte.','2014-04-01 00:00:00','2014-04-30 00:00:00',5,16),(148,'9 Peixe & Mar ',' Na mesma linha de ideias, Robert Hughes disse que algo é arte se foi criado com o fim expresso de ser considerado como tal e foi colocado em um contexto em que é visto como tal.','2014-04-17 00:00:00','2014-04-20 00:00:00',5,49),(149,'9ª Cavalgada Ecológica e Cultural ','24 Segundo a definição da Encyclopedia Britannica, arte é aquilo que é criado deliberadamente pelo homem como uma expressão de habilidade ou da imaginação.','2014-07-04 00:00:00','2014-07-08 00:00:00',2,56),(150,'9ª Chocofest ','As artes são muitas vezes divididas em categorias específicas, tais como artes decorativas, artes plásticas ou visuais, artes do espectáculo, ou literatura.','2014-04-03 00:00:00','2014-04-21 00:00:00',5,51),(151,'9ª Confraternização Moto Grupo Unidos Pela Máquina ',' A pintura é uma forma de arte plástica ou visual, e a poesia é uma forma de literatura.','2014-04-05 00:00:00','2014-04-06 00:00:00',5,71),(152,'9ª Expopedras ','Uma forma de arte é uma forma específica de expressão artística, é um termo mais específico do que arte em geral, mas menos específico do que gênero.','2014-03-19 00:00:00','2014-03-23 00:00:00',5,95),(153,'9ª Exposição Regional de Orquídeas e 2 Bazar de Flor & Arte ',' Alguns exemplos incluem Arquitetura, Arte digital, Banda desenhada, Cinema, Dança, Desenho, Escultura, Graffiti, Fotografia, Literatura (Poesia e Prosa), Teatro, Música, Pintura, etc.','2014-03-29 00:00:00','2014-03-30 00:00:00',5,94),(154,'9ª Facic ','As técnicas para uma obra de arte ser construída são as mais diversas.','2014-05-09 00:00:00','2014-05-11 00:00:00',4,72),(155,'9ª Jantar Típico Italiano ',' Cada técnica caracteriza-se pelo emprego do material físico e de como se maneja tal material para atingir os resultados desejados.','2014-05-01 00:00:00','2014-05-30 00:00:00',5,59),(156,'9ª Magia da Páscoa ',' Assim, por exemplo, pedra e bronze são dois materiais utilizados na técnica da escultura por subtração, a qual se inclui na forma artística da escultura.','2014-04-12 00:00:00','2014-04-20 00:00:00',5,43),(157,'9ª Romaria e Festa de Santo Expedito ',' A música e a poesia usam o som, a pintura usa as técnicas do óleo, aquarela, guache, encáustica, etc.','2014-04-17 00:00:00','2014-04-20 00:00:00',5,112),(158,'9ª Trilha Tatu ','Um gênero artístico é o conjunto de convenções, temáticas e estilos dentro de uma forma de arte e mídia.','2014-04-19 00:00:00','2014-04-25 00:00:00',7,20),(159,'Carnaval ',' Por exemplo, o Cinema possui uma gama de gêneros, como aventura, horror, comédia, romance, ficção científica, etc.','2014-03-15 00:00:00','2014-03-17 00:00:00',4,72),(160,'Carnaval 2014 ',' Na música, há centenas de gêneros musicais, que variam de região, cultura e etc.','2014-02-13 00:00:00','2014-03-04 00:00:00',4,5),(161,'Carnaval de Rua ',', e vão da música erudita clássica, música folclórica,rock, MPB, música pop, muzak, etc.','2014-01-28 00:00:00','2014-02-02 00:00:00',4,76),(162,'Cruzeiro da Amizade – Laguna dos Patos ',' Na pintura incluem paisagem, retrato, nu, natureza morta, paisagem, cena histórica, etc.','2014-01-09 00:00:00','2014-01-25 00:00:00',7,8),(163,'Festa Colonial ','Desenvolveu-se entre o Paleolítico Superior e o Neolítico, onde aparecem as primeiras manifestações que podem ser considerados como arte.','2014-07-19 00:00:00','2014-07-29 00:00:00',3,58),(164,'Festa da Colheita da Macela ',' No Paleolítico o homem, dedicado à caça e vivendo em cavernas, praticou a chamada arte rupestre.','2014-04-17 00:00:00','2014-04-18 00:00:00',5,10),(165,'Festa de La Primma Vendemia ',' No Neolítico tornou-se sedentário e desenvolveu a agricultura, com sociedades cada vez mais complexas, onde a religião ganhou importância.','2014-01-24 00:00:00','2014-01-26 00:00:00',6,91),(166,'Festa de Nossa Senhora dos Navegantes ',' São exemplos os monumentos megalíticos e um início de produção artesanal na forma de vasos de cerâmica e estatuetas.','2014-02-02 00:00:00','2014-02-09 00:00:00',6,13),(167,'Festa de Santo Antônio de Pádua ','No Egito e na Mesopotâmia viveram as primeiras civilizações altamente estruturadas, e seus artistas/artesãos produziram obras complexas que já apresentam uma especialização profissional.','2014-06-15 00:00:00','2014-06-22 00:00:00',6,82),(168,'Festa de São Gabriel ',' A arte egípcia se caracterizou pelo caráter religioso e político, com destaque para a arquitetura, a pintura e a escultura.','2014-04-03 00:00:00','2014-04-05 00:00:00',6,66),(169,'Festa de São Pedro ',' A escultura e a pintura mostram a figura humana em um estilo fortemente hierático e esquemático, devido à rigidez de seus cânones simbólicos e religiosos.','2014-06-29 00:00:00','2014-07-04 00:00:00',6,76),(170,'Festa em Honra ao Padroeiro Santo Antônio de Pádua ',' A arte mesopotâmica se desenvolveu na área entre os rios Tigre e Eufrates, sendo testemunha de culturas diferentes, como os sumérios, acadianos, assírios e persas.','2014-07-05 00:00:00','2014-07-08 00:00:00',6,81),(171,'Festival de Verão de ',' Na arquitetura se incluem os zigurates, grandes templos piramidais em degraus, enquanto que na escultura predomina cenas religiosas, de caça e de guerra, com a presença de figuras humanas e animais reais ou mitológicos.','2014-01-01 00:00:00','2014-02-02 00:00:00',4,51),(172,'Homenagem à Iemanjá ','A arte da Grécia Antiga marcou a evolução da arte ocidental.','2014-02-02 00:00:00','2014-02-08 00:00:00',6,87),(173,'Páscoa em São Chico ',' Depois de um começo em que salientaram as civilizações Minoica e Micênica, a arte grega se desenvolveu em três períodos: arcaico, clássico e helenístico.','2014-04-18 00:00:00','2014-04-23 00:00:00',6,61),(174,'Reveillon ',' Na arquitetura se destacaram os templos, com suas três ordens: dórica, jônica e coríntia.','2014-01-01 00:00:00','2014-01-05 00:00:00',7,56),(175,'Rodeio Classificatório da 9ªRegião Tradicionalista ',' Na escultura dominou a representação do corpo humano, atingindo uma síntese entre naturalismo e idealismo no período clássico, com destaque para a produção de Míron, Fídias, Policleto e Praxíteles.','2014-01-31 00:00:00','2014-02-02 00:00:00',2,16),(176,'Rodeio Crioulo Estadual ',' Com claros precedentes na arte etrusca e na arte grega, a arte romana alcançou quase todos os cantos da Europa, Norte de África e do Oriente Médio, estabelecendo as bases da arte ocidental.','2014-02-21 00:00:00','2014-02-23 00:00:00',2,103),(177,'Triunfolia ',' Grandes engenheiros e construtores, se destacaram na arquitetura civil desenvolvendo o arco e a cúpula, com a construção de estradas, pontes, aquedutos e obras urbanas, bem como os templos, palácios, teatros, anfiteatros, circos, banhos, arcos triunfais, etc.','2014-02-28 00:00:00','2014-03-03 00:00:00',4,78),(178,'Via Sacra ',' A escultura, inspirada na grega, é também centrada na figura humana, mas de forma mais realista.','2014-04-18 00:00:00','2014-04-22 00:00:00',6,89);
